    {id: 141, question_id: 62, language: "sw", text: "Kwa miezi 12 iliyopita ni mara ngapi ulipata jeraha mbaya? ", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 142, question_id: 62, language: "am", text: "ባለፉት 12 ወራት ስንት ጊዜ ከባድ የመቁሰል አደጋ ደርሶብሀል/ሻል?", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
