    {id: 144, question_id: 62, language: "te", text: "గడిచిన 12 నెలల కాల౦లో, మీరు ఎన్నిసార్లు తీవ్ర౦గా గాయపడినారు?  ", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 145, question_id: 63, language: "sw", text: "Katika miezi 12 iliyopita, ni ajali gani mbaya zaidi iliyokutendekea?", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
