    {id: 152, question_id: 64, language: "te", text: "గడిచిన 12 నెలల కాల౦లో, మీకు  అత్యంత తీవ్ర గాయం అవడానికి గల ముఖ్య కారణ౦ ఏమిటి?\r\n", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 153, question_id: 65, language: "sw", text: "Katika miezi 12 iliyopita, ajali mbaya zaidi ilikutendekea jinsi gani?", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
