    {id: 156, question_id: 65, language: "te", text: "గడిచిన 12 నెలల కాల౦లో, మీకు తీవ్ర గాయ౦ ఎలా జరిగి౦ది?  \r\n", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 157, question_id: 66, language: "sw", text: "Umewahi kwenda kwa watoaji utunzaji wa afya wafuatao katika miezi 12 iliyopita kwa sababu ya tatizo la kiafya?", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
