    {id: 160, question_id: 67, language: "sw", text: "Katika miezi 12 iliyopita ni mara ngapi WEWE umekwenda katika kituo cha afya au kumuona muuguzi kwa sababu ya tatizo la afya?", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
