    {id: 165, question_id: 68, language: "km", text: "តើប៉ុន្មានដង ដែលអ្នកបានព្យាបាលនៅមន្ទីរពេទ្យ ក្នុងអំឡុង១២ខែកន្លងមក?", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 166, question_id: 69, language: "sw", text: "Kiasi gani cha pesa kimetumiwa kwa gharama zako za matibabu katika miezi 12 iliyopita?\n\nTafadhali jumuisha gharama zinazohusiana na dawa, daktari, hospitali, zahanati, wapeana huduma wengine wa afya, upasuaji, ada za maabara, ada za kujiandikisha, ada za kuonana na daktari, ada za kupimwa, vifaa vyovyote vya matibabu, gharama za usafiri unaohusiana na huduma ya matibabu, nk., bila kujali aliyelipia yote haya.", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 167, question_id: 69, language: "am", text: "ባለፉት 12 ወራት ጤናህ/ሽን ለመንከባከብ ወጪ የተደረገው ገንዘብ ምን ያህል ነው?\n\nእባክህ/ሽ ከመድኃኒት፣ ከሐኪም፣ ከሆስፒታል፣ ከክሊኒክ፣ ከሌላ የጤና እንክብካቤ አገልግሎት ሰጪ፣ ከቀዶ ሕክምና፣ ከላብራቶር ክፍያ፣ ከምዝገባ ክፍያ፣ ከምክር አገልግሎት ክፍያ፣ ከምርምራ አገልግሎቶች፣ ከማንኛውም የሕክምና አቅርቦት፣ ከሕክምና እርዳታ ጋር በተያያዘ የተደረጉ የጉዞ ወጪዎችን ወዘተ ማንኛውም ሰው ይክፈለው አካትት/ቺ።", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 168, question_id: 69, language: "km", text: "តើអស់ប្រាក់ប៉ុន្មាន||ដែលបានចំណាយលើការ||ថែរក្សាសុខភាពរបស់អ្នក​ ក្នុងអំឡុង១២ខែកន្លងមកនេះ?\n\nសូមរាប់បញ្ចូលទំាងចំណាយទៅលើថ្នាំពេទ្យ វេជ្ជបណ្ឌិត មន្ទីរពេទ្យ មន្ទីរពេទ្យសាខា អ្នកផ្តល់ការថែររក្សាសុខភាពផ្សេងទៀត ការវះកាត់ តមៃ្លមន្ទីរពិសោធន៍ តមៃ្លការចុះឈោ្មះ តមៃ្លនៃការពិគ្រោះ សេវ៉ាកម្មស្រាវជ្រាវរករោគ​ ឧបករណ៍ពេទ្យណាមួយ ចំណាយលើការ​ ធ្វើដំណើរដែលទាក់ទង||នឹងការថែរក្សាសុខភាព។ល។​ ទោះជាអ្នកណា​ ចំណាយប្រាក់លើពួកគាត់/នាងក៏ដោយ។", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 169, question_id: 70, language: "sw", text: "Je umewahi shiriki katika mafunzo au programu kuhusu elimu ya ngono?", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
