    {id: 418, question_id: 153, language: "te", text: "అసురక్షిత స౦భోగ౦ చేసిన ఒక వార౦ తరువాత HIV పరీక్ష చేయిస్తే ఆ వ్యక్తికి ఈ అసురక్షిత స౦భోగ౦ వలన HIV వచ్చే అవకాశ౦ ఉన్నదని తెలియ చేస్తు౦ది.  ", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
