    {id: 437, question_id: 158, language: "km", text: "ការរួមភេទដោយហឹង្សា អាចធ្វើអោយ ដាច់រលាត់ទ្វាមាស ដែលវាធ្វើអោយ ងាយស្រួលសំរាប់មេរោគហ៊ីវក្នុងការចម្លង", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
