    {id: 443, question_id: 160, language: "sw", text: "Kumpiga mwanamke ni dalili nzuri ya mwanamume kuonyesha anampenda  \r\n", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
