    {id: 492, question_id: 174, language: "km", text: "ខ្ញុំមានអារម្មណ៍ថាជាប់គាំងឬជាប់នៅក្នុងទំនាក់ទំនងរបស់យើង។", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 493, question_id: 175, language: "sw", text: "Mwenzi wangu anafanya anavyotaka, hata kama sitaki afanye.", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
