    {id: 807, question_id: 274, language: "am", text: "ራሴን፤ ሆዴን በጣም ያመኛል በሽታዎች ያጠቁኛል ", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 808, question_id: 274, language: "km", text: "ខ្ញុំឈឺក្បាល ឈឺពោះ ឬក៏ មានជម្ងឺច្រើន។", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 809, question_id: 274, language: "te", text: " నాకు ఎక్కువగా తలనొప్పి , కడుపు నొప్పి వంటి అస్వస్దతలు వస్తాయి  ", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 810, question_id: 275, language: "sw", text: "Nakasirika sana na mara nyingi nina hamaki.", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 811, question_id: 275, language: "am", text: "በጣም እናደድና ግልፍ ይለኛል ", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 812, question_id: 275, language: "km", text: "ខ្ញុំខឹងខ្លាំង ហើយជាទូទៅបាត់បង់អារម្មណ៍របស់ខ្ញុំ។", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 813, question_id: 275, language: "te", text: "నాకు చాలా కోపం వస్తుంది తరచూ సహనం కోల్పోతాను", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 814, question_id: 276, language: "sw", text: "Napenda kukaa peke yangu kuliko na watu wengine.", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 815, question_id: 276, language: "am", text: "ከሰዎች ጋር ከመሆን ብቸኝነትን እመርጣለሁ ", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 816, question_id: 276, language: "km", text: "ខ្ញុំចូលចិត្តនៅម្នាក់ឯង ជាជាងនៅជាមួយមនុស្សដ៏ទៃផ្សេងៗទៀត។", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 817, question_id: 277, language: "sw", text: "Kwa kawaida nina nia ya kufanya yale ambayo watu wengine wanataka.", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 818, question_id: 277, language: "am", text: "ብዙውን ጊዜ በተነገረኝ መንገድ ነው የምሰራው", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 819, question_id: 277, language: "km", text: "ខ្ញុំជាទូទៅស្ម័គ្រធ្វើអ្វីដែលអ្នកដ៏ទៃចង់អោយធ្វើ។", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 820, question_id: 278, language: "sw", text: "Ninakua na wasiwasi sana.", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 821, question_id: 278, language: "am", text: "በጣም እጨነቃለው ", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 822, question_id: 278, language: "km", text: "ខ្ញុំមានការបារម្ភច្រើនណាស់។", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 823, question_id: 278, language: "te", text: "నేను చాలా ఆందోళన తో ఉంటాను", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 824, question_id: 279, language: "sw", text: "Kila mara mimi huwa nahangaika au situlii pahali pamoja.", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 825, question_id: 279, language: "am", text: "ሁልጊዜ እቁነጠነጣለሁ።", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 826, question_id: 279, language: "km", text: "ខ្ញុំតែងតែនៅមិនសុខឬរើកំរើកមិនឈប់។", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 827, question_id: 279, language: "te", text: "నేను నిరంతరం కుదురు లేకుండా అటూ ఇటూ కదులుతూ ఉంటాను లేదా తత్తరపాటుతో మెలికలు తిరుగుతూ ఉంటాను.\r\n", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 828, question_id: 280, language: "sw", text: "Nina angalau rafiki mmoja mwema.", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 829, question_id: 280, language: "am", text: "አንድ ወይም ከአንድ በላይ ጥሩ ጓደኛ አለኝ", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 830, question_id: 280, language: "km", text: "ខ្ញុំមានយ៉ាងហោចណាស់ មិត្តភក្តិល្អម្នាក់។", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 831, question_id: 281, language: "sw", text: "Mimi hupingana sana. Naweza kuwalazimisha watu wafanye ninavyotaka mimi.", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 832, question_id: 281, language: "am", text: "ሁልጊዜ እጣላለሁ። ሰዎች እኔ የምፈልገውን እንዲያደርጉ ማስገደድ እችላለሁ።", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 833, question_id: 281, language: "km", text: "ខ្ញុំវាយតប់ច្រើន។ ខ្ញុំអាចធ្វើឲ្យមនុស្សដទៃទៀតធ្វើអ្វីៗដែលខ្ញុំចង់។", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 834, question_id: 281, language: "te", text: "నేను చాలా పోట్లాడుతుంటాను.నాకు ఏమి కావాలో, అది ఇతరులు చేసేటట్లు చేయగలుగుతాను.\r\n", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 835, question_id: 282, language: "sw", text: "Mara nyingi huwa sina furaha, nasononeka au nimejaa machozi.", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 836, question_id: 282, language: "am", text: "ብዙውን ጊዜ ደስታ የራቀኝ፣ የምቆዝም ወይም ሆደባሻ ነኝ።", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 837, question_id: 282, language: "km", text: "ខ្ញុំជាញឹកញាប់តែងតែមិនសប្បាយចិត្ត ក្រៀមក្រំ ឬយំច្រើន។", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 838, question_id: 282, language: "te", text: "నేను తరచుగా విచారంగా,కుంగిపోయి మరియు కన్నీళ్ళు కారుస్తూ ఉంటాను.", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 839, question_id: 283, language: "sw", text: "Kwa ujumla, watu wengine wananipenda.", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 840, question_id: 283, language: "am", text: "አብዛኞቹ ሰዎች እኔን ይወዱኛል። ", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 841, question_id: 283, language: "km", text: "មនុស្សផ្សេងទៀតជាទូទៅគឺចូលចិត្តខ្ញុំ។", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 842, question_id: 284, language: "sw", text: "Ni rahisi kuondolewa kwenye mawazo, siwezi kuzingatia mawazo kwenye jambo moja.", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 843, question_id: 284, language: "am", text: "ሀሳቤ በቀላሉ ይሰረቃል። ሀሳቤን መሰብሰብ ያስቸግረኛል። ", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 844, question_id: 284, language: "km", text: "ខ្ញុំងាយនឹងធ្វេសប្រហែស ខ្ញុំឃើញថាវាមានការពិបាកក្នុងការប្រមូលផ្តុំ អារម្មណ៍។", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 845, question_id: 284, language: "te", text: "నా దృష్టి ఇట్టే మళ్ళి పోతుంది. ఏకాగ్రత చూపడం కష్టంగా ఉంది", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 846, question_id: 285, language: "sw", text: "Nina hofu kweye hali mpya. Nashindwa kujiamini.", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 847, question_id: 285, language: "am", text: "አዲስ ሁኔታ ሲያጋጥመኝ እናደዳለው። በራስ የመተማመን መንፈሴን በቀላሉ አጣለው።", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 848, question_id: 285, language: "km", text: "ខ្ញុំមានអារម្មណ៍រអើលចំពោះស្ថានភាពថ្មី។ ខ្ញុំងាយស្រួលនឹងបាត់បង់ទំនុកចិត្តណាស់។", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 849, question_id: 285, language: "te", text: "నేను కొత్త పరిస్దితులలో ఉద్రిక్తంగా ఉంటాను . నాకు ఇట్టె నమ్మకం పోతుంది", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 850, question_id: 286, language: "sw", text: "Mara nyingi huwa nashutumiwa kuwa mwongo au mdanganyifu.", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 851, question_id: 286, language: "am", text: "ብዙውን ጊዜ ትዋሻለህ/ለሽ ወይም ታጭበረብራለህ/ሽ ብለው ይከስሱኛል።\r\n", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 852, question_id: 286, language: "km", text: "ខ្ញុំជាញឹកញាប់តែងតែត្រូវបានគេចោទថា ភរកុហក ឬ បោកបញ្ឆោតគេ។", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 853, question_id: 286, language: "te", text: "అబద్ధాలు చెప్పుతానని లేదా మోసం చేస్తానని నా మీద తరచుగా నేరం మోపబడుతూ ఉంటుంది.", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 854, question_id: 287, language: "sw", text: "Watu wengine hunichokoza na kuninyanyasa.", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 855, question_id: 287, language: "am", text: "ሌሎች ልጆች ወይንም ወጣቶች ይተርቡኛል ወይም ጉልበተኛ ይሆኑብኛል፣", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 856, question_id: 287, language: "km", text: "មនុស្សផ្សេងទៀត ឆាឆៅ ឬ សម្លុតខ្ញុំ។", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 857, question_id: 288, language: "sw", text: "Ninafikiria kwanza kabla ya kufanya mambo.", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 858, question_id: 288, language: "am", text: "አንድ ነገር ከመስራቴ በፊት አስባለው ", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 859, question_id: 288, language: "km", text: "ខ្ញុំគិតមុនខ្ញុំធ្វើអ្វីមួយ។", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 860, question_id: 288, language: "te", text: "నేను పనులు చేసేముందు ఆలోచిస్తా", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 861, question_id: 289, language: "sw", text: "Ninachukua vitu visivyo vyangu kutoka nyumbani, kazini, au sehemu nyingine.", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 862, question_id: 289, language: "am", text: "የራሴን ያልሆኑትን ነገሮች ከትምህርት ቤት፣ ከቤት ወይም ከሌላ ቦታ እወስዳለሁ፣", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 863, question_id: 289, language: "km", text: "ខ្ញុំយករបស់អ្វីមួយដែលមិនមែនជារបស់ខ្ញុំពីផ្ទះ កន្លែងធ្វើការ និង កន្លែងផ្សេងទៀត។", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 864, question_id: 290, language: "sw", text: "Ninaelewana vyema zaidi na watu wa umri mkubwa kunishinda kuliko watu wengine wa umri wangu.", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 865, question_id: 290, language: "am", text: "ከእድሜ እኩዮቼ ልቅ በእድሜ ከሚበልጡኝ ትልልቅ ሰዋች ጋር እግባባለሁ፣", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 866, question_id: 290, language: "km", text: "ខ្ញុំចុះសម្រុងល្អជាមួយមនុស្សចាស់ ជាងមនុស្សដែលមានអាយុ​ប្រហាក់ប្រហែលខ្ញុំ។", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 867, question_id: 291, language: "sw", text: "Nina hofu nyingi, mimi hutishika kirahisi.", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
