    {id: 992, question_id: 326, language: "am", text: "አንዲት ሴት ልጆችዋን መንከባከብ እንጂ ስለ ሌሎች ሰወች ጉደይ መጨነቅ የለበትም. ", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 993, question_id: 326, language: "km", text: "ស្ត្រីម្នាក់គួរតែយកចិត្តទុកដាក់ថែរក្សាកូនរបស់ខ្លួនយ៉ាងល្អហើយកុំបារម្ភអំពីកិច្ចការរបស់អ្នកដទៃ។", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 994, question_id: 327, language: "sw", text: "Wanawake wanafaa waachie siasa wanaume.", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 995, question_id: 327, language: "am", text: "ሴቶች ፖለቲካን ለወንዶች  መተው አለባቸው. ", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 996, question_id: 327, language: "km", text: "ស្រ្តីគួរទុករឿងនយោបាយអោយបុរស។", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 997, question_id: 328, language: "sw", text: "Mwanamke anafaa kuwa na mume au watoto wa kiume au jamaa wengine wa kiume kumlinda.", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 998, question_id: 328, language: "am", text: "አንዲት ሴት የሚጠብቅት ባል ወይም ወንዶች ልጆች ወይም ሌላ ወንድ ዘመድ ሊኖረት ይገባል. ", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 999, question_id: 328, language: "km", text: "ស្ត្រីម្នាក់ត្រូវតែមានប្តី ឬ កូនប្រុស ឬ ញាតិសន្ដានប្រុសៗផ្សេងទៀតដើម្បីការពារនាង។", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 1000, question_id: 329, language: "sw", text: "Jambo pekee ambalo mwanamke anaweza tegemea katika uzee wake ni watoto wake wa kiume.", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 1001, question_id: 329, language: "am", text: "አንዲት ሴት በእርጅናዋ ጊዜ የምትተማመነዉ በወንዶች ልጆቿ  ነው. ", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 1002, question_id: 329, language: "km", text: "រឿងតែមួយគត់ដែលស្ត្រីអាចពឹងផ្អែកលើអាយុចាស់របស់នាងគឺកូនប្រុសរបស់នាង។", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 1003, question_id: 330, language: "sw", text: "Mwanamke mzuri huwa haulizi mawazo ya mumewe, hata kama hana uhakika ikiwa anakubaliana nayo.", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 1004, question_id: 330, language: "am", text: "ጥሩ ሴት ከሌሎች ጋር ስለመስማማት እርግጠኛ ባትሆንም የባሏን አስተያየት ግን . ", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 1005, question_id: 330, language: "km", text: "ស្ត្រីល្អម្នាក់មិនដែលសួរអំពីគំនិតរបស់ស្វាមីរបស់នាងឡើយ ទោះបីជានាងមិនប្រាកដថានាងយល់ស្របជាមួយពួកវាក៏ដោយ។", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 1006, question_id: 331, language: "sw", text: "Ikiwa ni swali la afya ya watoto, ni vyema kufanya kile baba anataka.", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 1007, question_id: 331, language: "am", text: "ስለ ልጆች ጤና ጉዳይ ሲነሳ, አባቱ የሚፈልገውን ሁሉ ማድረግ ተገቢ ነው. ", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 1008, question_id: 331, language: "km", text: "នៅពេលដែលវាជាសំណួរនៃហាសុខភាពរបស់កូនកូន វាជាការល្អបំផុតក្នុងការធ្វើអ្វីដែលឪពុកចង់ធ្វើ។", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 1009, question_id: 332, language: "sw", text: "Watoto wa kike wanapaswa kufanya kazi mbali na nyumbani baada ya kuwa na watoto ikiwa wanataka.", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 1010, question_id: 332, language: "am", text: "ሴት ልጆች ከወለዱ በኋላ ከቤት ውጭ መሥራት መቻል አለባቸው. ", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 1011, question_id: 332, language: "km", text: "កូនស្រីគួរតែអាចធ្វើការនៅខាងក្រៅផ្ទះបន្ទាប់ពីពួកគេមានកូនប្រសិនបើពួកគេចង់ធ្វើ។", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 1012, question_id: 333, language: "sw", text: "Watoto wa kike wanapaswa kupewa nafasi sawa na watoto wa kiume kufanya kazi nje ya nyumbani.", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 1013, question_id: 333, language: "am", text: "ሴት ልጆችምእንደ ወንዶች ከቤት ዉጪ የመሠራት ዕዲል ሊኖራቾዉ ይገባል፡፡ ", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 1014, question_id: 333, language: "km", text: "កូនស្រីគួរតែមានឱកាសដូចគ្នាដើម្បីធ្វើការនៅខាងក្រៅផ្ទះដូចជាកូនប្រុសដែរ។", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 1015, question_id: 334, language: "sw", text: "Watoto wa kike wanapaswa kuambiwa  sababu muhimu ya kutokuwa na watoto wengi ni kwa ajili ya wao kuweza kufanya kazi nje ya nyumbani na waweze kupata pesa.", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 1016, question_id: 334, language: "am", text: "ሴቶች  ልጆች ከቤት ዉጪ ሠርተዉ ገንዘብ እንዲያገኙ ከፈለጉ ብዙ ልጆች ከመወለድ እንድቆጠቡ ልነገረቸዉ ይገባል. ", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 1017, question_id: 334, language: "km", text: "គេគួរប្រាប់កូនស្រីថាមូលហេតុសំខាន់ដែលមិនឱ្យមានកូនច្រើនពេកដូច្នេះពួកគេអាចធ្វើការនៅក្រៅផ្ទះនិងរកលុយបាន។", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 1018, question_id: 335, language: "sw", text: "Ningependa mtoto wangu wa kike awe na uwezo wa kufanya kazi nje ya nyumbani ndiposa aweze kujitegemea ikiwa ni lazima.", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 1019, question_id: 335, language: "am", text: "ሴት ልጅ ከቤት ውጭ እንድትሰራ  እና ራሷን ለመደገፍ እንድትችል እፈልጋለሁ. ", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 1020, question_id: 335, language: "km", text: "ខ្ញុំចង់អោយកូនស្រីខ្ញុំអាចធ្វើការនៅខាងក្រៅផ្ទះដូច្នេះនាងអាចជួយខ្លួនឯងប្រសិនបើចាំបាច់។", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 1021, question_id: 336, language: "sw", text: "Unashughulikiwa kwa kiasi kidogo cha upole au heshima kuliko watu wengine.", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
