    {id: 1023, question_id: 336, language: "km", text: "អ្នកត្រូវបានគេមិនសូវគួរសម ឬក៏ គោរពជាងមនុស្សផ្សេងទៀត។", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 1024, question_id: 337, language: "sw", text: "Unapokea huduma duni zaidi kuliko watu wengine kwenye soko au katika maghala.", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 1025, question_id: 337, language: "am", text: "በገቢያ ፣ በሱቅ፣ በመደብር ከሌሎች ያነሰ አገልግሎት ነው የሚሰጥዎት\n", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 1026, question_id: 337, language: "km", text: "អ្នកទទួលសេវាកម្មអន់ជាងមនុស្សផ្សេងទៀតនៅ ផ្សារ ឬក៏ក្នុងហាង។", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 1027, question_id: 338, language: "sw", text: "Watu hukutendea kana kwamba wewe sio mwerevu.", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 1028, question_id: 338, language: "am", text: "ሰዎች ጎበዝና ብልህ እንዳልሆኑ አድርገው ይቆጥሩዎታል.", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
