    {id: 1033, question_id: 340, language: "sw", text: "Unatishiwa au unasumbuliwa.", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 1034, question_id: 340, language: "am", text: "እርስዎን ዛቻ ወይም ትንኮሳ ያጋጥሞታል", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 1035, question_id: 340, language: "km", text: "អ្នកត្រូវបានគេគំរាមកំហែង ឬក៏ បៀតបៀន។", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 1036, question_id: 341, language: "sw", text: "Uliza tu kama mhojiwa alijibu \"Mara chache \nkwa mwaka\" au mara nyingi zaidi kwa swali moja la ubaguzi.\n\nUnafikiria ni nini sababu kuu ya uzoefu huu?", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 1037, question_id: 341, language: "am", text: "\"ቢያንስ በዓመት ውስጥ ጥቂት ጊዜ\" ወይም ብዙ ጊዜ አንድ መድሎን አስመልክቶ መልስ ሲሰጥ ብቻ ጠይቁ. \n\nለእነዚህ ገጠመኞች ዋና ምክንያቱ ምን ይመስልሀል/ሻል?", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 1038, question_id: 341, language: "km", text: "សូមសួរលុះត្រាតែអ្នកផ្តល់ចម្លើយ ឆ្លើយថា «ពីរបីដងក្នុងមួយឆ្នាំ» ឬក៏ វាកើតឡើងញឹកញាប់ យ៉ាងហោចណាស់សំរាប់ មួយសំនួរស្តីអំពីការរើសអើង។\n\nតើអ្នកគិតថាអ្វីគឺជាមូលហេតុចំបងសំរាប់បទពិសោធន៍ទាំងនេះ?", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 1039, question_id: 342, language: "sw", text: "...haukuwa na chakula cha kutosha.", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 1040, question_id: 342, language: "am", text: "\t……..ለመብላት በቂ አልነበሩም.", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 1041, question_id: 342, language: "km", text: "អ្នកបានមិនមានអ្វីគ្រប់គ្រាន់សំរាប់ញាំ", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 1042, question_id: 343, language: "sw", text: "...ulijua kuna mtu wakukutunza na kukulinda.", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
