    {id: 1044, question_id: 343, language: "km", text: "អ្នកបានដឹងថាមានអ្នកណាម្នាក់ថែទាំអ្នក ហើយនិង ការពារអ្នក", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
