    {id: 1079, question_id: 355, language: "sw", text: "Kwa miezi 12 iliyopita, je uliwahi fikiria kimakini kujiua?", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
