    {id: 1081, question_id: 355, language: "km", text: "អំឡុងពេល ១២​ខែមុន តើអ្នកធ្លាប់បានពិចារណារ៍ដោយប្រាកដប្រជាក្នុង បញ្ចប់ជីវិតរបស់អ្នកដែលឬទេ?", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 1082, question_id: 355, language: "te", text: "గడిచిన 12 నెలల కాల౦లో ఎప్పుడైనా మీరు మీ జీవితాన్ని అ౦త౦ చేసుకోవాలని గ౦భీర౦గా అలోచి౦చారా?     \n", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
    {id: 1083, question_id: 356, language: "sw", text: "Kwa miezi 12 iliyopita, je ulifanya mpango kuhusu jinsi ungejaribu kujiua?", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
