    {id: 1085, question_id: 356, language: "km", text: "អំឡុងពេល ១២​ខែមុន តើអ្នកបានធ្វើផែនការអំពី របៀបនៃការចង់ប៉ុនប៉ង សំលាប់ខ្លួនដែលឬទេ?", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
