    {id: 1087, question_id: 357, language: "sw", text: "Ni kwa umuhimu gani au isiyo na umuhimu, imani ya kidini huunda jinsi unavyoishi maisha yako ya kila siku? Ni: ", reg_ex_validation_message: nil, question_changed: false, instructions: nil, instrument_translation_id: nil},
