    {id: 412, option_id: 160, text: "బాగా ఉ౦డదు", language: "te", option_changed: false, instrument_translation_id: nil},
    {id: 413, option_id: 161, text: "Sina tatizo katika kutembea", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 414, option_id: 162, text: "Nina matatizo kidogo katika kutembea", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 415, option_id: 163, text: "Nina matatizo kiasi katika kutembea", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 416, option_id: 164, text: "Nina matatizo sana katika kutembea", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 417, option_id: 165, text: "Siwezi kutembea kabisa", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 418, option_id: 166, text: "Sina tatizo kujihudumia mwenyewe", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 419, option_id: 167, text: "Nina matatizo kidogo katika kujisafisha au kuvaa mwenyewe", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 420, option_id: 168, text: "Nina matatizo kiasi katika kujisafisha au kuvaa mwenyewe", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 421, option_id: 169, text: "Nina matatizo sana katika kujisafisha au kuvaa mwenyewe", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 422, option_id: 170, text: "Siwezi kujisafisha wala kuvaa mwenyewe", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 423, option_id: 171, text: "Sina tatizo katika kufanya shughuli zangu za kawaida za kila siku", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 424, option_id: 172, text: "Nina matatizo kidogo katika kufanya shughuli zangu za kawaida za kila siku", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 425, option_id: 173, text: "Nina matatizo kiasi katika ufanya shughuli zangu za kawaida za kila siku", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 426, option_id: 174, text: "Nina matatizo sana katika kufanya shughuli zangu za kawaida za kila siku", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 427, option_id: 175, text: "Siwezi kabisa kufanya shughuli zangu za kawaida za kila siku", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 428, option_id: 176, text: "Sina maumivu au sina kutojisikia vizuri", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 429, option_id: 177, text: "Nina maumivu kidogo au najisikia vibaya kidogo", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 430, option_id: 178, text: "Nina maumivu kiasi au najisikia vibaya kiasi", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 431, option_id: 179, text: "Nina maumivu makali au najisikia vibaya", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 432, option_id: 180, text: "Nina maumivu makali sana au najisikia vibaya sana", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 433, option_id: 181, text: "Sina wasiwasi wala msongo wa mawazo", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 434, option_id: 182, text: "Nina wasiwasi au msongo wa mawazo kidogo", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 435, option_id: 183, text: "Nina wasiwasi au msongo wa mawazo kiasi", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 436, option_id: 184, text: "Nina wasiwasi au msongo wa mawazo mkubwa", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 437, option_id: 185, text: "Nina wasiwasi au msongo wa mawazo mkubwa sana", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 438, option_id: 186, text: "Asthma", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 439, option_id: 187, text: "Maumivu ya kifua", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 440, option_id: 188, text: "Maumivu ya tumbo", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 441, option_id: 189, text: "Vidonda vya tumbo", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 442, option_id: 190, text: "Shinikizo ya damu", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 443, option_id: 191, text: "Kuumwa na kichwa", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 444, option_id: 192, text: "Kisukari", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 445, option_id: 193, text: "VIRUSI", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 446, option_id: 194, text: "Kifafa", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 447, option_id: 195, text: "Ulemavu wa kimwili", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 448, option_id: 196, text: "Nilikuwa na fupa lililovunjika au kiungo kilichoteguka", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 449, option_id: 196, text: "የአጥንት ስብራት ወይም የመጋጠሚያ መላቀቅ/መውለቅ አጋጠመኝ", language: "am", option_changed: false, instrument_translation_id: nil},
    {id: 450, option_id: 196, text: "ខ្ញុំត្រូវបានមានការបាក់ឆ្អឹង ឬក៏ ថ្លោះគ្រេចសន្លាក់ឆ្អឹង", language: "km", option_changed: false, instrument_translation_id: nil},
    {id: 451, option_id: 196, text: "నా ఎముక విరిగి౦ది లేదా ఎముకల అతుకు ప్రక్కకు జరిగి౦ది", language: "te", option_changed: false, instrument_translation_id: nil},
    {id: 452, option_id: 197, text: "Nilikuwa na panchari au kidonda cha kuchomwa", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 453, option_id: 197, text: "የመቆረጥ፣ መበሳት፣ ወይም መወጋት የመቁሰል አደጋ አጋጠመኝ", language: "am", option_changed: false, instrument_translation_id: nil},
    {id: 454, option_id: 197, text: "ខ្ញុំត្រូវបាន កាត់ ទម្លុះ ឬ ចាក់អោយរបួស", language: "km", option_changed: false, instrument_translation_id: nil},
    {id: 455, option_id: 197, text: "నాకు కోసుకుంది, గాయమైంది, పొడిచిన గాయమైంది", language: "te", option_changed: false, instrument_translation_id: nil},
    {id: 456, option_id: 198, text: "Niligongwa kichwa au majeraha mengine ya kichwa au shingo, yaliyomwangusha chini au kushindwa kupumua", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 457, option_id: 198, text: "የመናጋት ወይም ሌላ የራስ ወይም የአንገት ጉዳት፣ ራሴን አለማወቅ፣ መተንፈስ ያለመቻል", language: "am", option_changed: false, instrument_translation_id: nil},
    {id: 458, option_id: 198, text: "ខ្ញុំមានការប៉ះទង្គិចក្បាល ឬ របួសក្បាល ឬ ក៏ផ្សេងៗទៀត ដែលបានធ្វើអោយសន្លប់ ឬ មិនអាចដកដង្ហើម", language: "km", option_changed: false, instrument_translation_id: nil},
    {id: 459, option_id: 198, text: "నాకు గట్టి దెబ్బతగిలింది, తల లేదా మెడకు గాయమైంది, క్రింద పడిపోయాను, శ్వాసతీసుకోవడం కష్టమైంది", language: "te", option_changed: false, instrument_translation_id: nil},
    {id: 460, option_id: 199, text: "Nilikuwa na kidonda iliyosababishwa na kupigwa risasi", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 461, option_id: 199, text: "በጥይት መሳሪያ ቆሰልኩ", language: "am", option_changed: false, instrument_translation_id: nil},
    {id: 462, option_id: 199, text: "ខ្ញុំត្រូវបានរបួសដោយការបាញ់កាំភ្លើង", language: "km", option_changed: false, instrument_translation_id: nil},
    {id: 463, option_id: 199, text: "నాకు తుపాకి కాల్చిన  గాయ౦ అయి౦ది", language: "te", option_changed: false, instrument_translation_id: nil},
    {id: 464, option_id: 200, text: "Nilikuwa nimeungua vibaya", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 465, option_id: 200, text: "ከባድ የቃጠሎ አደጋ አጋጠመኝ", language: "am", option_changed: false, instrument_translation_id: nil},
    {id: 466, option_id: 200, text: "ខ្ញុំត្រូវបានទទួលការឆេះយ៉ាងអាក្រក់", language: "km", option_changed: false, instrument_translation_id: nil},
    {id: 467, option_id: 200, text: "నాకు చాలా ఎక్కువగా కాలి౦ది", language: "te", option_changed: false, instrument_translation_id: nil},
    {id: 468, option_id: 201, text: "Nilipoteza yote au sehemu ya mguu au mkono", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 469, option_id: 201, text: "እግሮቼን ወይም እጆቼን አጣሁኝ", language: "am", option_changed: false, instrument_translation_id: nil},
    {id: 470, option_id: 201, text: "ខ្ញុំបានបាត់បង់ទាំងមូល ឬក៏ ផ្នែកនៃប្រអប់ជើង ជើង ប្រអប់ដៃ ឬ ដៃ", language: "km", option_changed: false, instrument_translation_id: nil},
    {id: 471, option_id: 201, text: "నేను పాదం ,కాలు లేదా చేతిలో కొంత భాగము లేదా పూర్తిగా పోగొట్టుకున్నాను", language: "te", option_changed: false, instrument_translation_id: nil},
    {id: 472, option_id: 202, text: "Jambo lingine linitendekea", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 473, option_id: 202, text: "ሌላ ነገር ደረሰብኝ", language: "am", option_changed: false, instrument_translation_id: nil},
    {id: 474, option_id: 202, text: "មានអ្វីផ្សេងទៀតបានកើតឡើងចំពោះខ្ញុំ", language: "km", option_changed: false, instrument_translation_id: nil},
    {id: 475, option_id: 202, text: "ఇవి కాకుండా వేరొక ప్రమాదము జరిగింది", language: "te", option_changed: false, instrument_translation_id: nil},
    {id: 476, option_id: 203, text: "Nilipatwa na ajali ya gari au niligongwa na gari", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 477, option_id: 203, text: "የሞተር ተሸከርካሪ አደጋ አጋጥሞኝ ወይም በሞተር ተሸከርካሪ ተገጭቼ", language: "am", option_changed: false, instrument_translation_id: nil},
    {id: 478, option_id: 203, text: "ខ្ញុំមានគ្រោះថ្នាក់រថយន្ត ឬបុកដោយរថយន្ត", language: "km", option_changed: false, instrument_translation_id: nil},
    {id: 479, option_id: 203, text: "నేను ఒక మోటారు దుర్ఘటనలో ఉన్నాను లేదా మోటారు నన్ను ఢీ కొట్టింది", language: "te", option_changed: false, instrument_translation_id: nil},
    {id: 480, option_id: 204, text: "Nilianguka", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 481, option_id: 204, text: "ወድቄl", language: "am", option_changed: false, instrument_translation_id: nil},
    {id: 482, option_id: 204, text: "ខ្ញុំដួល", language: "km", option_changed: false, instrument_translation_id: nil},
    {id: 483, option_id: 204, text: "నేను పడ్డాను", language: "te", option_changed: false, instrument_translation_id: nil},
    {id: 484, option_id: 205, text: "Niliangukiwa na kitu au kilinigonga", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 485, option_id: 205, text: "ሌላ ነገር ወድቆብኝ ወይም መትቶኝ", language: "am", option_changed: false, instrument_translation_id: nil},
    {id: 486, option_id: 205, text: "អ្វីមួយធ្លាក់លើខ្ញុំឬប៉ះខ្ញុំ", language: "km", option_changed: false, instrument_translation_id: nil},
    {id: 487, option_id: 205, text: "నా మీద ఏదో పడింది లేదా నన్ను కొట్టింది", language: "te", option_changed: false, instrument_translation_id: nil},
    {id: 488, option_id: 206, text: "Nilikuwa napigana na mtu", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 489, option_id: 206, text: "ከሰው ጋር መጣላቴ", language: "am", option_changed: false, instrument_translation_id: nil},
    {id: 490, option_id: 206, text: "ខ្ញុំវាយតប់ជាមួយអ្នកណាម្នាក់", language: "km", option_changed: false, instrument_translation_id: nil},
    {id: 491, option_id: 206, text: "నేను ఎవరితోనో పోట్లాడుతున్నాను", language: "te", option_changed: false, instrument_translation_id: nil},
    {id: 492, option_id: 207, text: "Nilivamiwa, nilipigwa, au nilinyanyaswa na mtu", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 493, option_id: 207, text: "ሌላ ሰው ጥቃት ሰንዝሮብኝ፣ ደብድቦኝ ወይም እንግልት አድርሶብኝ", language: "am", option_changed: false, instrument_translation_id: nil},
    {id: 494, option_id: 207, text: "ខ្ញុំត្រូវបានវាយប្រហារ វាយលុក រំលោភគំរាមដោយអ្នកណាម្នាក់", language: "km", option_changed: false, instrument_translation_id: nil},
    {id: 495, option_id: 207, text: "నా మీద ఎవరో దాడి చేసారు,దౌర్జన్యం చేసారు,లేదా అత్యాచారం చేసారు", language: "te", option_changed: false, instrument_translation_id: nil},
    {id: 496, option_id: 208, text: "Nilichomeka na moto au nilikuwa karibu mno na mwenge au kitu cha moto", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 497, option_id: 208, text: "እሳት ውስጥ ገብቼ ወይም ለእሳት ወይም ለጋለ ነገር ቀርቤ", language: "am", option_changed: false, instrument_translation_id: nil},
    {id: 498, option_id: 208, text: "ខ្ញុំនៅក្នុងភ្លើងឆេះឬក្បែរភ្លើងពេកឬអ្វីក្តៅ", language: "km", option_changed: false, instrument_translation_id: nil},
    {id: 499, option_id: 208, text: "నేను ఒక నేను అగ్నిప్రమాదంలో ఉన్నాను  లేదా మంటకు లేదా ఏదో వేడిగా ఉన్న వస్తువుకు చాలా దగ్గరగా ఉన్నాను", language: "te", option_changed: false, instrument_translation_id: nil},
    {id: 500, option_id: 209, text: "Jeraha langu lilisababishwa na Kitu kingine", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 501, option_id: 209, text: "ጉዳቱን ያደረሰብኝ ሌላ ነገር ነው", language: "am", option_changed: false, instrument_translation_id: nil},
    {id: 502, option_id: 209, text: "អ្វីផ្សេងទៀតបណ្តាលរបួសរបស់ខ្ញុំ", language: "km", option_changed: false, instrument_translation_id: nil},
    {id: 503, option_id: 209, text: "ఇంకేదో కారణం వలన నాకు గాయమయింది", language: "te", option_changed: false, instrument_translation_id: nil},
    {id: 504, option_id: 210, text: "Nilijijeruhi kwa bahati mbaya", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 505, option_id: 210, text: "በራሴ ላይ አደጋ አድርሼ ነው የተጎዳሁት", language: "am", option_changed: false, instrument_translation_id: nil},
    {id: 506, option_id: 210, text: "ខ្ញុំធ្វើឲ្យឈឺខ្លួនឯងដោយចៃដន្យ", language: "km", option_changed: false, instrument_translation_id: nil},
