    {id: 823, option_id: 309, text: "ខ្ញុំមានផលប៉ះពាល់ពីថ្នាំ / កន្ទួលរោលលើស្បែក", language: "km", option_changed: false, instrument_translation_id: nil},
    {id: 824, option_id: 310, text: "Kituo/ duka la dawa liko mbali na mimi kuweza kupata madawa kila mara", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 825, option_id: 310, text: "መድኃኒት ቤቱ ከኔ በጣም ሩቅ ስለሆነ", language: "am", option_changed: false, instrument_translation_id: nil},
    {id: 826, option_id: 310, text: "កន្លែងផ្តល់សេវា / ឱសថស្ថានគឺនៅឆ្ងាយពេកសម្រាប់ខ្ញុំដើម្បីទទួលថ្នាំជាប្រចាំ", language: "km", option_changed: false, instrument_translation_id: nil},
    {id: 827, option_id: 311, text: "Siezi imudu", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 828, option_id: 311, text: "መድኃኒቱን ለመግዛት አቅም የለኝም", language: "am", option_changed: false, instrument_translation_id: nil},
    {id: 829, option_id: 311, text: "ខ្ញុំមិនអាចមានលទ្ធភាព (បញ្ហាហិរញ្ញវត្ថុ)", language: "km", option_changed: false, instrument_translation_id: nil},
    {id: 830, option_id: 312, text: "Sidhani kama ninaihitaji; sijihisi mgonjwa", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 831, option_id: 312, text: "የሚያስፈልገኝ አይመስለኝም/ ህመም አይሰማኝም", language: "am", option_changed: false, instrument_translation_id: nil},
    {id: 832, option_id: 312, text: "ខ្ញុំមិនគិតថាខ្ញុំត្រូវការវា ខ្ញុំមិនមានអារម្មណ៍ថាឈឺ", language: "km", option_changed: false, instrument_translation_id: nil},
    {id: 833, option_id: 313, text: "Nilijaribu lakini duka la dawa/ kituo kilikuwa kimeishiwa na dawa", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 834, option_id: 313, text: "መድኃኒት ቤቱ መድኃኒቱን የለውም", language: "am", option_changed: false, instrument_translation_id: nil},
    {id: 835, option_id: 313, text: "ខ្ញុំបានព្យាយាម ប៉ុន្តែឱសថស្ថាន/កន្លែងផ្តល់សេវាកឺបានអស់ពីស្តុក", language: "km", option_changed: false, instrument_translation_id: nil},
    {id: 836, option_id: 314, text: "Nahofia / naogopa watu watajua nina VVU nikichukua", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 837, option_id: 314, text: "መድኀኒቱን ከወሰድኩ ሰዎች ኤች አይ ቪ እነዳለብኝ ያውቃሉ ብዬ ለምፈራ", language: "am", option_changed: false, instrument_translation_id: nil},
    {id: 838, option_id: 314, text: "ខ្ញុំខ្លាចថាមនុស្សនឹងដឹងថាខ្ញុំមានផ្ទុកមេរោគអេដស៍ប្រសិនបើខ្ញុំយកវា", language: "km", option_changed: false, instrument_translation_id: nil},
    {id: 839, option_id: 315, text: "Nimeshikika sana/sina wakati wa kuchukua dawa", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 840, option_id: 315, text: "ስራ ስለሚበዛብኝ ሄጄ መውሰድ አልቻልኩም", language: "am", option_changed: false, instrument_translation_id: nil},
    {id: 841, option_id: 315, text: "រវល់ពេក/គ្មានពេលទៅយកថ្នាំ", language: "km", option_changed: false, instrument_translation_id: nil},
    {id: 842, option_id: 316, text: "Sijawahi kukosa matibabu", language: "sw", option_changed: false, instrument_translation_id: nil},
    {id: 843, option_id: 316, text: "ረስቼ አላውቅም", language: "am", option_changed: false, instrument_translation_id: nil},
