  Instruction.create!([
    {id: 1, title: "Mark <u>one</u>:", text: "Mark <u>one</u>:", deleted_at: nil},
    {id: 2, title: "Select the gender the participant identifies as, which may be different from his/her biological sex.", text: "Select the gender the participant identifies as, which may be different from his/her biological sex.", deleted_at: nil},
    {id: 3, title: "If the respondent answers \"Christian\" but does not know the denomination, select \"Christian-Other.\"", text: "If the respondent answers \"Christian\" but does not know the denomination, select \"Christian-Other.\"", deleted_at: nil},
    {id: 4, title: "If the child has already completed all education, cross-through as \"NA\".", text: "If the child has already completed all education, cross-through as \"NA\".", deleted_at: nil},
    {id: 5, title: "Mark <u>all that apply</u>:", text: "Mark <u>all that apply</u>:", deleted_at: nil},
    {id: 6, title: "Please remind the child that his/her answers are confidential.", text: "Please remind the child that his/her answers are confidential.", deleted_at: nil},
    {id: 17, title: "Include all visits to the hospital.", text: "Include all visits to the hospital.", deleted_at: nil},
    {id: 7, title: "We are looking for activities that YOU ARE engaged in that assist the family/household/institution financially, even if YOU ARE not directly receiving money (making crafts to be sold, weaving, selling items, sex work, begging, stealing).", text: "We are looking for activities that YOU ARE engaged in that assist the family/household/institution financially, even if YOU ARE not directly receiving money (making crafts to be sold, weaving, selling items, sex work, begging, stealing).", deleted_at: nil},
    {id: 8, title: "Make sure to prompt about sex work! (ask in a sensitive manner)", text: "Make sure to prompt about sex work! (ask in a sensitive manner)", deleted_at: nil},
    {id: 9, title: "<b>Response Category EXAMPLES</b>\n\n<b>Professional, technical, or management</b> = Includes people with specialized training and education. Examples are teachers, nurses/doctors, lawyers, accountants, IT support, researchers, directors or coordinators, supervisors. People who own their own businesses and employ other workers may be considered \"management.\" Also includes people with specialized technical training (such as tailors, carpenters, electricians, mechanics).\n\n<b>Agriculture</b> = Farmwork or raising livestock. Includes large-scale and small-scale farm owners, farm workers, fruit or vegetable pickers.\n\n<b>Household / domestic</b> = Anyone who works in a house or for a household. Includes house wives, personal drivers, personal cooks, house help, gardeners, home security guards, laundry workers, maids, servants, building cleaners.\n\n<b>Services</b> = Someone who works in a business that directly serves people (note: does NOT necessarily mean he/she is a government employee). Includes hotel employees, taxi drivers, tour guides, restaurant workers.\n\n<b>Manual</b> = Brick maker, factory worker, house builder, road worker, construction worker, non-farm daily wage workers.", text: "<b>Response Category EXAMPLES</b>\n\n<b>Professional, technical, or management</b> = Includes people with specialized training and education. Examples are teachers, nurses/doctors, lawyers, accountants, IT support, researchers, directors or coordinators, supervisors. People who own their own businesses and employ other workers may be considered \"management.\" Also includes people with specialized technical training (such as tailors, carpenters, electricians, mechanics).\n\n<b>Agriculture</b> = Farmwork or raising livestock. Includes large-scale and small-scale farm owners, farm workers, fruit or vegetable pickers.\n\n<b>Household / domestic</b> = Anyone who works in a house or for a household. Includes house wives, personal drivers, personal cooks, house help, gardeners, home security guards, laundry workers, maids, servants, building cleaners.\n\n<b>Services</b> = Someone who works in a business that directly serves people (note: does NOT necessarily mean he/she is a government employee). Includes hotel employees, taxi drivers, tour guides, restaurant workers.\n\n<b>Manual</b> = Brick maker, factory worker, house builder, road worker, construction worker, non-farm daily wage workers.", deleted_at: nil},
    {id: 10, title: "Do not read this question aloud, it is to be completed by the interviewer. To code, refer to the list of response category examples provided above.", text: "Do not read this question aloud, it is to be completed by the interviewer. To code, refer to the list of response category examples provided above.", deleted_at: nil},
    {id: 11, title: "Do not include work that the child identifies as his/her primary occupation. Clarify for child that this question is asking about OTHER work they may have done that is income generating or work trade.", text: "Do not include work that the child identifies as his/her primary occupation. Clarify for child that this question is asking about OTHER work they may have done that is income generating or work trade.", deleted_at: nil},
    {id: 12, title: "Clarify that the hours reported by the child for income-generating work/work trade are separate from the hours worked as the child's primary occupation.", text: "Clarify that the hours reported by the child for income-generating work/work trade are separate from the hours worked as the child's primary occupation.", deleted_at: nil},
    {id: 13, title: "If the child works only occasionally, such as during school vacations/holidays, estimate the average \"monthly\" income by calculating the total amount received in a year and dividing by 12.", text: "If the child works only occasionally, such as during school vacations/holidays, estimate the average \"monthly\" income by calculating the total amount received in a year and dividing by 12.", deleted_at: nil},
    {id: 21, title: "Clarify that we are asking about intercourse that was either forced or consensual, as well as vaginal or anal intercourse (whichever he/she experienced first).", text: "Clarify that we are asking about intercourse that was either forced or consensual, as well as vaginal or anal intercourse (whichever he/she experienced first).", deleted_at: nil},
    {id: 16, title: "The next 5 questions ask about the most serious injury that happened to you during the past 12 months. An injury is serious when it makes you miss at least one full day of usual activities (such as school, sports, or a job) or requires treatment by a doctor or nurse.", text: "The next 5 questions ask about the most serious injury that happened to you during the past 12 months. An injury is serious when it makes you miss at least one full day of usual activities (such as school, sports, or a job) or requires treatment by a doctor or nurse.", deleted_at: nil},
    {id: 20, title: "Now we'd like to ask you some questions about your own sex life. We know these are personal questions, but remember that your name does not appear anywhere on this form. Remember, also, that it is only with completely truthful information that we can build programs to reduce HIV risk. So, please be totally honest.", text: "Now we'd like to ask you some questions about your own sex life. We know these are personal questions, but remember that your name does not appear anywhere on this form. Remember, also, that it is only with completely truthful information that we can build programs to reduce HIV risk. So, please be totally honest.", deleted_at: nil},
    {id: 14, title: "The following questions are about your health.", text: "The following questions are about your health.", deleted_at: nil},
    {id: 15, title: "EQ-5D TABLE", text: "EQ-5D TABLE", deleted_at: nil},
    {id: 18, title: "Please think of all the health care that YOU have received during the past 12 months.", text: "Please think of all the health care that YOU have received during the past 12 months.", deleted_at: nil},
    {id: 19, title: "Probe about various medical expenses; record the total of all expenses.", text: "Probe about various medical expenses; record the total of all expenses.", deleted_at: nil},
    {id: 22, title: "Clarify that we are asking about intercourse that was either forced or consensual, as well as vaginal or anal intercourse.", text: "Clarify that we are asking about intercourse that was either forced or consensual, as well as vaginal or anal intercourse.", deleted_at: nil},
    {id: 23, title: "TO BE PUT INTO A TABLE", text: "TO BE PUT INTO A TABLE", deleted_at: nil},
    {id: 24, title: "Now I would like to ask you some questions about the LAST 3 partners you have had sex with in the past 12 months. \nLet me assure you again that your answers are completely confidential and will not be told to anyone. If we should come to any question that you don't want to answer, just let me know and we will go to the next question.", text: "Now I would like to ask you some questions about the LAST 3 partners you have had sex with in the past 12 months. \nLet me assure you again that your answers are completely confidential and will not be told to anyone. If we should come to any question that you don't want to answer, just let me know and we will go to the next question.", deleted_at: nil},
    {id: 25, title: "Skip section if 0 sexual partners in last 12 months.", text: "Skip section if 0 sexual partners in last 12 months.", deleted_at: nil},
    {id: 26, title: "Write down the initials of all 3 partners before beginning.", text: "Write down the initials of all 3 partners before beginning.", deleted_at: nil},
    {id: 27, title: "Thank you. Let's start with questions only about (INITIALS).", text: "Thank you. Let's start with questions only about (INITIALS).", deleted_at: nil},
    {id: 28, title: "If less than one week, record in days. If less than one month, record in weeks. Otherwise, record in months.", text: "If less than one week, record in days. If less than one month, record in weeks. Otherwise, record in months.", deleted_at: nil},
    {id: 29, title: "If the participant has multiple partners, ask about his or her MAIN partner. If no main partner, follow skip to q:2g1.", text: "If the participant has multiple partners, ask about his or her MAIN partner. If no main partner, follow skip to q:2g1.", deleted_at: nil},
    {id: 30, title: "Record (approximate) date since which time respondent has been in a relationship with this person.", text: "Record (approximate) date since which time respondent has been in a relationship with this person.", deleted_at: nil},
    {id: 31, title: "Interviewer information: The birth control methods listed below are described as follows:\n\n1) The pill = oral pill delivering hormones to inhibit female fertility\n2) A diaphragm = small latex cup placed in vagina to act as a barrier to the cervix\n3) An IUD (intrauterine device) = T-shaped device placed in uterus to prevent pregnancy\n4) Depo-Provera = hormone injection given every 3 months\n5) Sterilization (\"have your tubes tied\") = Surgery to prevent pregnancy\n6) Condoms\n7) Norplant = capsule containing hormones that is surgically implanted into the arm for up to 5 years\n8) Cervical cap = thimble-size barrier placed over the cervix to prevent pregnancy; smaller than a diaphragm\n9) Morning after pill (emergency contraception) = oral pill taken after intercourse to prevent pregnancy\n10) Withdrawal method = ejaculating outside of the vagina\n11) Rhythm method = avoiding sex during certain days of the menstrual cycle\n12) Anal sex to prevent pregnancy", text: "Interviewer information: The birth control methods listed below are described as follows:\n\n1) The pill = oral pill delivering hormones to inhibit female fertility\n2) A diaphragm = small latex cup placed in vagina to act as a barrier to the cervix\n3) An IUD (intrauterine device) = T-shaped device placed in uterus to prevent pregnancy\n4) Depo-Provera = hormone injection given every 3 months\n5) Sterilization (\"have your tubes tied\") = Surgery to prevent pregnancy\n6) Condoms\n7) Norplant = capsule containing hormones that is surgically implanted into the arm for up to 5 years\n8) Cervical cap = thimble-size barrier placed over the cervix to prevent pregnancy; smaller than a diaphragm\n9) Morning after pill (emergency contraception) = oral pill taken after intercourse to prevent pregnancy\n10) Withdrawal method = ejaculating outside of the vagina\n11) Rhythm method = avoiding sex during certain days of the menstrual cycle\n12) Anal sex to prevent pregnancy", deleted_at: nil},
    {id: 32, title: "Mark <u>all that apply</u> (do NOT read to respondent):", text: "Mark <u>all that apply</u> (do NOT read to respondent):", deleted_at: nil},
    {id: 33, title: "Interviewer information: STI = Sexually transmitted infection. Common symptoms include itching in the genital area, pain during urination, pain during sex, abnormal discharge, painful sores or bumps in the genital area.", text: "Interviewer information: STI = Sexually transmitted infection. Common symptoms include itching in the genital area, pain during urination, pain during sex, abnormal discharge, painful sores or bumps in the genital area.", deleted_at: nil},
    {id: 34, title: "The following questions are about your personal STI history, your birth control usage and your HIV status and testing. By Sexually Transmitted Infections (STI), I mean one that your partner can pass to you or that you can pass to your partner through sexual intercourse. We know these are personal questions, but remember that your name does not appear anywhere on this form.", text: "The following questions are about your personal STI history, your birth control usage and your HIV status and testing. By Sexually Transmitted Infections (STI), I mean one that your partner can pass to you or that you can pass to your partner through sexual intercourse. We know these are personal questions, but remember that your name does not appear anywhere on this form.", deleted_at: nil},
    {id: 35, title: "SET UP LOOP.\n\nInterviewers: Record STI name in local language.", text: "SET UP LOOP.\n\nInterviewers: Record STI name in local language.", deleted_at: nil},
    {id: 36, title: "Do not read this question aloud; it is to be completed by the interviewer.", text: "Do not read this question aloud; it is to be completed by the interviewer.", deleted_at: nil},
    {id: 37, title: "Ask only for respondents who identify as HIV-positive.", text: "Ask only for respondents who identify as HIV-positive.", deleted_at: nil},
    {id: 38, title: "MONTH AND YEAR", text: "MONTH AND YEAR", deleted_at: nil},
    {id: 39, title: "Record the answer in Months if less than one year. Record \"00\" if less than one month.", text: "Record the answer in Months if less than one year. Record \"00\" if less than one month.", deleted_at: nil},
    {id: 40, title: "If YES: Who have you told that you have HIV?", text: "If YES: Who have you told that you have HIV?", deleted_at: nil},
    {id: 41, title: "Now we have a set of statements about HIV and AIDS we'd like you to answer. For each statement, please tell me whether you Strongly Disagree, Disagree, Agree, or Strongly Agree.", text: "Now we have a set of statements about HIV and AIDS we'd like you to answer. For each statement, please tell me whether you Strongly Disagree, Disagree, Agree, or Strongly Agree.", deleted_at: nil},
    {id: 43, title: "This section will only be administered to FEMALES.", text: "This section will only be administered to FEMALES.", deleted_at: nil},
    {id: 42, title: "Now we have a set of statements about sex and condoms we'd like you to answer. For each statement, please tell me whether you Strongly Disagree, Disagree, Agree, or Strongly Agree.", text: "Now we have a set of statements about sex and condoms we'd like you to answer. For each statement, please tell me whether you Strongly Disagree, Disagree, Agree, or Strongly Agree.", deleted_at: nil},
    {id: 45, title: "Please be sure to ask the questions in this subsection with special care and empathy.", text: "Please be sure to ask the questions in this subsection with special care and empathy.", deleted_at: nil},
    {id: 44, title: "How much do you agree or disagree with each of the following statements?", text: "How much do you agree or disagree with each of the following statements?", deleted_at: nil},
    {id: 85, title: "\"How many times\" refers to the number of servings the child ate. For example:\n*Fruit:* if both a banana and an orange were eaten during the same meal, that would count as \"two times.\" *Vegetables:* if both spinach and carrots were eaten during the same meal, that would count as \"two times.\" *Protein:* if both fish and beef were eaten during the same meal, that would count as \"two times.\"", text: "\"How many times\" refers to the number of servings the child ate. For example:\n*Fruit:* if both a banana and an orange were eaten during the same meal, that would count as \"two times.\" *Vegetables:* if both spinach and carrots were eaten during the same meal, that would count as \"two times.\" *Protein:* if both fish and beef were eaten during the same meal, that would count as \"two times.\"", deleted_at: nil},
    {id: 86, title: "Cambodia only", text: "Cambodia only", deleted_at: nil},
    {id: 46, title: "<b>Introduction</b>. The next set of questions focuses on issues related to your health as a woman. Please take your time answering these questions, and feel free to ask the interviewer about any questions you don't understand.", text: "<b>Introduction</b>. The next set of questions focuses on issues related to your health as a woman. Please take your time answering these questions, and feel free to ask the interviewer about any questions you don't understand.", deleted_at: nil},
    {id: 47, title: "Include miscarriages, abortions, still births, and current pregnancy.", text: "Include miscarriages, abortions, still births, and current pregnancy.", deleted_at: nil},
    {id: 48, title: "If respondent replies 0, please probe - \"any baby who cried or showed signs of life but later died?\" Please make sure to ask this question with care and with empathy.", text: "If respondent replies 0, please probe - \"any baby who cried or showed signs of life but later died?\" Please make sure to ask this question with care and with empathy.", deleted_at: nil},
    {id: 49, title: "Please ensure that the sum of the numbers reported in the previous 4 questions is equal to the total number of pregnancies reported (minus current pregnancy, if applicable).", text: "Please ensure that the sum of the numbers reported in the previous 4 questions is equal to the total number of pregnancies reported (minus current pregnancy, if applicable).", deleted_at: nil},
    {id: 50, title: "Ask for each pregnancy.", text: "Ask for each pregnancy.", deleted_at: nil},
    {id: 51, title: "Ask about first pregnancy only.", text: "Ask about first pregnancy only.", deleted_at: nil},
    {id: 52, title: "This question refers to visiting a health care facility for antenatal care. \n\nAsk for each pregnancy. (TO BE PUT IN TABLE)", text: "This question refers to visiting a health care facility for antenatal care. \n\nAsk for each pregnancy. (TO BE PUT IN TABLE)", deleted_at: nil},
    {id: 53, title: "Ask for each pregnancy. (TO BE PUT IN TABLE)", text: "Ask for each pregnancy. (TO BE PUT IN TABLE)", deleted_at: nil},
    {id: 54, title: "\"Alcohol\" is any alcoholic beverage including mbege, kimpumu, mnazi, dengurua, or ulanzi. Drinking alcohol does not include drinking a few sips of wine for religious purposes.", text: "\"Alcohol\" is any alcoholic beverage including mbege, kimpumu, mnazi, dengurua, or ulanzi. Drinking alcohol does not include drinking a few sips of wine for religious purposes.", deleted_at: nil},
    {id: 55, title: "PUT IN TABLE", text: "PUT IN TABLE", deleted_at: nil},
    {id: 59, title: "You may feel uncomfortable answering some of these questions. Please remember that you can always refuse to answer any question or stop the questionnaire at any time. You may also skip any question that you are not comfortable answering. Your answers are confidential and are only used to help us understand how people your age think and act.", text: "You may feel uncomfortable answering some of these questions. Please remember that you can always refuse to answer any question or stop the questionnaire at any time. You may also skip any question that you are not comfortable answering. Your answers are confidential and are only used to help us understand how people your age think and act.", deleted_at: nil},
    {id: 56, title: "Probe if all answers are negative: \n\"Not even when you were in school?\"", text: "Probe if all answers are negative: \n\"Not even when you were in school?\"", deleted_at: nil},
    {id: 60, title: "*Cambodia:* 40,000 Riel\n*Ethiopia:* 270 birr\n*India:* 450 rupees\n*Kenya:* 1,000 Kenyan shillings\n*Tanzania:* 15,000 Tanzanian shillings", text: "*Cambodia:* 40,000 Riel\n*Ethiopia:* 270 birr\n*India:* 450 rupees\n*Kenya:* 1,000 Kenyan shillings\n*Tanzania:* 15,000 Tanzanian shillings", deleted_at: nil},
    {id: 57, title: "In the past three months, how often have you used the substances you mentioned?", text: "In the past three months, how often have you used the substances you mentioned?", deleted_at: nil},
    {id: 87, title: "Ethiopia only", text: "Ethiopia only", deleted_at: nil},
    {id: 61, title: "The next questions are about volunteer and community service work through such organizations as service clubs, church, and social action groups. Include only volunteer work that was unpaid.", text: "The next questions are about volunteer and community service work through such organizations as service clubs, church, and social action groups. Include only volunteer work that was unpaid.", deleted_at: nil},
    {id: 58, title: "_The next questions are about things you may have done in the past 12 months._", text: "_The next questions are about things you may have done in the past 12 months._", deleted_at: nil},
    {id: 88, title: "Kenya only.", text: "Kenya only.", deleted_at: nil},
    {id: 89, title: "Tanzania only.", text: "Tanzania only.", deleted_at: nil},
    {id: 90, title: "Imagine that this ladder represents how society is set up. At the top of the ladder are the people who are the best off - they have the most money, the highest amount of schooling, and the jobs that bring the most respect. At the bottom are the people who are the worst off - they have the least money, little or no education, no job or jobs that no one wants or respects.", text: "Imagine that this ladder represents how society is set up. At the top of the ladder are the people who are the best off - they have the most money, the highest amount of schooling, and the jobs that bring the most respect. At the bottom are the people who are the worst off - they have the least money, little or no education, no job or jobs that no one wants or respects.", deleted_at: nil},
    {id: 91, title: "Do not include identifying information about the participant here (names, contact info, etc.); that information should be recorded on the cover sheet instead.", text: "Do not include identifying information about the participant here (names, contact info, etc.); that information should be recorded on the cover sheet instead.", deleted_at: nil},
    {id: 62, title: "Listed below are a number of difficult or stressful things that sometimes happen to people. For each event please indicate: \n(a) it happened to you personally; \n(b) you witnessed it happen to someone else; \n(c) you learned about it happening to a close family member or close friend; \n(d) you were exposed to it as part of your job (for example, paramedic, police, military, or other first responder); \n(e) you're not sure if it fits; or \n(f) it doesn't apply to you.\n\nBe sure to consider your entire life (growing up as well as adulthood) as you go through the list of events.", text: "Listed below are a number of difficult or stressful things that sometimes happen to people. For each event please indicate: \n(a) it happened to you personally; \n(b) you witnessed it happen to someone else; \n(c) you learned about it happening to a close family member or close friend; \n(d) you were exposed to it as part of your job (for example, paramedic, police, military, or other first responder); \n(e) you're not sure if it fits; or \n(f) it doesn't apply to you.\n\nBe sure to consider your entire life (growing up as well as adulthood) as you go through the list of events.", deleted_at: nil},
    {id: 63, title: "TO BE PUT INTO A TABLE - change to \"select multiple\".\nIF A-D, ADD FOLLOW-UP QUESTION ASKING ABOUT LAST 12 MONTHS", text: "TO BE PUT INTO A TABLE - change to \"select multiple\".\nIF A-D, ADD FOLLOW-UP QUESTION ASKING ABOUT LAST 12 MONTHS", deleted_at: nil},
    {id: 64, title: "TO BE PUT INTO A TABLE - change to \"select multiple\"", text: "TO BE PUT INTO A TABLE - change to \"select multiple\"", deleted_at: nil},
    {id: 65, title: "Include accidents.\n\nTO BE PUT INTO A TABLE - change to \"select multiple\"", text: "Include accidents.\n\nTO BE PUT INTO A TABLE - change to \"select multiple\"", deleted_at: nil},
    {id: 66, title: "A person who has had an extremely stressful experience may have a range of different problems as a result of the stressful experience. Some people have had more than one extremely stressful experience. \n\nFor each of the questions below, please read each problem carefully and then select one response to indicate how much you have been bothered by that problem in the past month.", text: "A person who has had an extremely stressful experience may have a range of different problems as a result of the stressful experience. Some people have had more than one extremely stressful experience. \n\nFor each of the questions below, please read each problem carefully and then select one response to indicate how much you have been bothered by that problem in the past month.", deleted_at: nil},
    {id: 72, title: "In your day-to-day life how often have any of the following things happened to you?", text: "In your day-to-day life how often have any of the following things happened to you?", deleted_at: nil},
    {id: 68, title: "Please tell us how often each of the following statements is true. Is it true <b>\"None of the time,\" \"Some of the time,\"</b> or <b>\"All of the time\"</b>?", text: "Please tell us how often each of the following statements is true. Is it true <b>\"None of the time,\" \"Some of the time,\"</b> or <b>\"All of the time\"</b>?", deleted_at: nil},
    {id: 69, title: "I have someone who...", text: "I have someone who...", deleted_at: nil},
    {id: 67, title: "For each of the following statements, please tell me if it is Not True, Somewhat True, or Certainly True of you. It would help us if you answered all items as best you can even if you are not absolutely certain. Please give your answers on the basis of how things have been for you over the last six months. Remember, your answers are all confidential.", text: "For each of the following statements, please tell me if it is Not True, Somewhat True, or Certainly True of you. It would help us if you answered all items as best you can even if you are not absolutely certain. Please give your answers on the basis of how things have been for you over the last six months. Remember, your answers are all confidential.", deleted_at: nil},
    {id: 73, title: "Do not read response options to respondent.", text: "Do not read response options to respondent.", deleted_at: nil},
    {id: 74, title: "Please respond to the following statements as Never true, Rarely true, Sometimes true, Often true, or Very often true. \n\nWould you say, when you were growing up...", text: "Please respond to the following statements as Never true, Rarely true, Sometimes true, Often true, or Very often true. \n\nWould you say, when you were growing up...", deleted_at: nil},
    {id: 75, title: "How often during the past 2 weeks were you bothered by...", text: "How often during the past 2 weeks were you bothered by...", deleted_at: nil},
    {id: 70, title: "People sometimes look to others for companionship, assistance, or other types of support. How often is each of the following kinds of support available to you if you need it?", text: "People sometimes look to others for companionship, assistance, or other types of support. How often is each of the following kinds of support available to you if you need it?", deleted_at: nil},
    {id: 71, title: "To what extent do the sentences below describe you? Select one answer for each statement.", text: "To what extent do the sentences below describe you? Select one answer for each statement.", deleted_at: nil},
    {id: 78, title: "Include the POFO child if age 17 or younger.", text: "Include the POFO child if age 17 or younger.", deleted_at: nil},
    {id: 79, title: "If participant lives in a separate building but on the same property/compound as the caregiver/parent, record as \"yes\".", text: "If participant lives in a separate building but on the same property/compound as the caregiver/parent, record as \"yes\".", deleted_at: nil},
    {id: 80, title: "Enter the (approximate) date since which time the child has been without a caregiver.", text: "Enter the (approximate) date since which time the child has been without a caregiver.", deleted_at: nil},
    {id: 81, title: "Record the primary reason.", text: "Record the primary reason.", deleted_at: nil},
    {id: 76, title: "The next 2 questions ask about your feelings.", text: "The next 2 questions ask about your feelings.", deleted_at: nil},
    {id: 77, title: "<b>IMPORTANT:</b>\n\n<b> If the child answers \"yes\" to either of the two questions above, he/she should be referred to support services and monitored closely after the interview is over. Follow your site's protocol for dealing with situations where the child is upset or reports feeling suicidal.</b>", text: "<b>IMPORTANT:</b>\n\n<b> If the child answers \"yes\" to either of the two questions above, he/she should be referred to support services and monitored closely after the interview is over. Follow your site's protocol for dealing with situations where the child is upset or reports feeling suicidal.</b>", deleted_at: nil},
    {id: 82, title: "Record the (approximate) date the child began living in his/her current home.", text: "Record the (approximate) date the child began living in his/her current home.", deleted_at: nil},
    {id: 83, title: "Note to interviewer: \"this home\" refers to the child's current home.", text: "Note to interviewer: \"this home\" refers to the child's current home.", deleted_at: nil},
    {id: 84, title: "Do not read aloud.", text: "Do not read aloud.", deleted_at: nil},
    {id: 92, title: "Private Session", text: "<p>Please talk to the participant to find more about the issue</p>", deleted_at: nil}
  ])
  InstructionTranslation.create!([
    {id: 1, instruction_id: 7, language: "sw", text: "Tunatafuta mambo ambayo WEWE hushughulika nayo yanayosaidia jamii/nyumba/taasisi kwa fedha, hata kama WEWE hupokei pesa moja kwa moja (kutengeza vitu vya kuuzwa, vitu vya kusukwa, kuuza vitu, kazi ya ngono, kuomba, kuiba)."},
    {id: 2, instruction_id: 7, language: "am", text: "ገንዘቡን በቀጥታ የምትቀበለው/ዩው አንተ/ቺ ባትሆንም/ኚም ቤተሰቡን/ተቋሙን በገንዘብ የሚደግፉ የምትሠራቸው/ሪያቸው ሥራዎች (የሚሸጡ የዕደ ጥበብ ሥራዎች፣ ፈትል፣ ዕቃዎች መሸጥ፣ የወሲብ ሥራ፣ ልመና፣ ስርቆት) ካሉ ማወቅ እንፈልጋለን።"},
    {id: 3, instruction_id: 7, language: "km", text: "ការងារនិងការងារផ្ទះ\nយើងនឹងរកមើលសកម្មភាពទំាងឡាយ ដែលអ្នក ចូលរួមដែលជួយគ្រួសារ/ លំនៅដ្ឋាន/ការដ្ឋាន របស់អ្នកផ្នែកប្រាក់កាស សូម្បីតែអ្នកមិនបានទទួល ប្រាក់សុទ្ធសាធក៏ដោយ(ធ្វើឧបករណ៏អ្វីសំរាប់លក់ ត្បាញ លក់ឥវ៉ាន់ អ្នកធ្វើការផ្លូវភេទ សុំទាន លួច)។"},
    {id: 4, instruction_id: 14, language: "sw", text: "Maswali yafwatayo yanahusu afya yako."},
    {id: 5, instruction_id: 14, language: "am", text: "ቀጥሎ የቀረቡት ጥቄዎች ጤናህ/ሽን የሚመለከቱ ናቸው።"},
    {id: 6, instruction_id: 14, language: "km", text: "សំនួរខាងក្រោមនេះស្តីអំពីសុខភាពរបស់អ្នក។"},
    {id: 7, instruction_id: 14, language: "te", text: "కింద ఇచ్చిన ప్రశ్నలు మీ ఆరోగ్యం గురించి"},
    {id: 8, instruction_id: 16, language: "sw", text: "Maswali 5 yafwatayo yanauliza kuhusu jeraha kuu zaidi ulilopata katika miezi 12 iliyopita. Jeraha ni kuu ikiwa linakufanya ushindwe kushiriki katika shughuli za kawaida kwa angalau siku moja nzima (kama vile shule, michezo, au kazi) au linahitaji mauguzi ya daktari au muuguzi."},
    {id: 9, instruction_id: 16, language: "am", text: "ቀጥሎ ያሉት 5 ጥያቄዎች ባለፉት 12 ወራት ያጋጠመህን/ሽን በጣም ከባድ የሚባል ጉዳት የሚመለከቱ ናቸው።አንድ ጉዳት ከባድ ነው የሚባለው ከመደበኛው እንቅስቃሴ (እንደ ትምህርት ቤት፣ ስፖርት ወይም ሥራ ከመሳሰሉት) ቢያንስ አንድ ሙሉ ቀን የሚያተጓጉልህ/ሽ ሲሆን ወይም የሐኪም ወይም የነርስ ሕክምና እርዳታ ማግኘት የሚጠይቅ ሲሆን ነው።"},
    {id: 10, instruction_id: 16, language: "km", text: "សំនួរ៥បន្ទាប់ទៅនេះសួរអំពី របួសធ្ងន់ជាងគេ ដែលបានកើតមានដល់អ្នក ក្នុងអំឡុងពេល១២ខែកន្លងមក។ របួសវាធ្ងន់កាលណាវាធ្វើឲ្យអ្នកខកខាន យ៉ាងតិចមួយថៃ្ងពេញក្នុងសកម្មភាពធម្មតា(ដូចជាទៅសាលា កីឡា ឬការងារ) ឬតម្រូវការព្យាបាលពីវេជ្ជបណ្ឌិតឬគិលានុបដ្ឋាយិកា។"},
    {id: 11, instruction_id: 16, language: "te", text: "గడిచిన 12 నెలలలో, మీకు సంభవించిన అతి తీవ్రమైన గాయం గురించి  తదుపరి 5 ప్రశ్నలు అడుగుతాయి. మీ మామూలు కార్యకలాపాలను (స్కూలు, క్రీడలు, లేదా ఉద్యోగం వంటివి) కనీసం ఒక పూర్తి రోజు మిస్సయేట్లు చేస్తే లేదా వైద్యుడు లేదా నర్స్ ద్వారా చికిత్స అవసరమైతే, ఆ గాయం తీవ్రమైనది."},
    {id: 12, instruction_id: 18, language: "sw", text: "Tafadhali fikiria huduma zote za afya ambazo WEWE umepokea katika miezi 12 iliyopita."},
    {id: 13, instruction_id: 18, language: "am", text: "እባክህ/ሽ ባለፉት 12 ወራት ያገኘሃቸውን/ሻቸውን የጤና እንክብካቤ አገልግሎቶች በሙሉ አስብ/ቢ።"},
    {id: 14, instruction_id: 18, language: "km", text: "សូមគិតអំពី||ការថែរក្សាសុខភាពទំាងអស់||ដែលអ្នកបានទទួលក្នុងអំឡុង១២ខែ​ កន្លងមកនេះ។"},
    {id: 15, instruction_id: 20, language: "sw", text: "Kwa sasa tungependa kuuliza maswali machache kuhusu maisha yako ya ngono. Tunajua haya maswali ni ya kibinafsi lakini kumbuka kwamba jina lako halitaonekana mahali popote kwenye fomu hii. Kumbuka pia ni ukweli mtupu ndio utatusaidia kujenga mipangilio ya kupunguza hatari za HIV. Kwa hivyo uwe muaminifu kikamilifu"},
    {id: 16, instruction_id: 20, language: "am", text: "አሁን ስለ የግል የወሲብ ሕይወትህ/ሽ አንዳድ ጥያቄዎችን ልንጠይቅ እንወዳለን። እነዚህ የግል ጉዳይ መሆናቸውን እናውቃለን፣ ስምህ/ሽ በዚህ ቅጽ ላይ የትም ቦታ እንደማይኖር አስታውስ/ሺ። በተጨማሪም፣ የኤች.አይ.ቪ መጋለጥን የሚቀንስ ፕሮግራም ለመገንባት እንድንችል ሙሉ በሙሉ እውነት የሆነ መረጃ ስንሰበስብ ነው። ስለዚህም እባክህ/ሽ ሙሉ በሙሉ ታማኝ ሁን/ኝልን"},
    {id: 17, instruction_id: 20, language: "km", text: "ឥឡូវនេះ ពួកខ្ញុំចង់សួរអ្នកនូវសំនួរខ្លះស្តីអំពី ជីវិតការរួមភេទផ្ទាល់ខ្លួនរបស់ អ្នក។​ យើដឹងថា សំនួរទាំងនេះជាសំនួរផ្ទាល់ខ្លួន ប៉ុន្តែសូមចងចាំថាឈ្មោះ របស់អ្នកនឹងមិនលេចឡើងនៅកន្លែ​ងណាមួយ​នៅលើទំរង់នេះទេ។ សូមចងចាំថា វាថែមទាំងជាព័ត៌មាន ដែលពិត​ទាំងស្រុងដែលយើងអាចបង្កើតកម្មវិធីដើម្បីកាត់បន្ថយ ភាពគ្រោះថ្នាក់នៃមេរោគហ៊ីវ។\nអញ្ចឹង សូមផ្តល់ព័ត៌មានអោយស្មោះត្រង់ជាទីបំផុត។"},
    {id: 30, instruction_id: 42, language: "te", text: "లైంగిక చర్య మరియు కండోముల గురించి మీరు సమాధానాలను చెప్పాలని మేము కోరుతున్న కొన్ని వ్యాఖ్యలు మా వద్ద ఉన్నాయి. ప్రతి వ్యాఖ్యకు మీరు  గట్టిగా  అ౦గీకరి౦చరు, అ౦గీకరి౦చరు, అ౦గీకరిస్తారు, గట్టిగా అ౦గీకరిస్తారు అని దయచేసి నాకు చెప్పండి."},
    {id: 31, instruction_id: 44, language: "sw", text: "Ni kwa kiwango kipi unakubaliana au haukubaliani na matamshi yafuatayo?"},
    {id: 18, instruction_id: 20, language: "te", text: "మేము మీ స్వ౦త లై౦గిక జీవిత౦ గురి౦చి కొన్ని ప్రశ్నలు అడగాలనుకు౦టున్నాము. ఇవి వ్యక్తిగత ప్రశ్నలు అని మాకు తెలుసు, కానీ మే పేరు ఈ ఫార౦లో ఎక్కడ కూడా కనపడవు అని గుర్తు౦చుకో౦డి. పూర్తి, నిజమైన సమాచార౦తో మాత్రమే మన౦ HIVని తగ్గి౦చే కార్యక్రమాలను అభివృద్ధి చేయగలమని కుడా గుర్తు౦చుకో౦డి. అ౦దువలన దయచేసి పూర్తి నిజాయితీగా ఉ౦డ౦డి."},
    {id: 19, instruction_id: 34, language: "sw", text: "Maswali yafuatayo yanahusu historia yako ya magonjwa ya zinaa, utumiaji wa njia za kupanga uzazi na hali yako ya HIV na kuchunguzwa. Kwa Magonjwa ya zinaa, ninamaanisha yale yanayopitishwa kwako na mwenzako kupitia ngono. Tunajua haya ni maswali ya faragha, lakini kumbuka kuwa jina lako halionekani mahali popote kwenye fomu hii."},
    {id: 20, instruction_id: 34, language: "am", text: "የሚከተሉት ጥያቄዎች ስለአባላዘር በሽታዎችህ/ሽ፣ የእርግዝና መከላከያ አጠቃቀምህ/ሽ፣ እና የኤች.አይ.ቪ ምርመራና ውጤትህ/ሽን የሚመለከቱ ናቸው። የአባላዘር በሽታዎች ስል በወሲባዊ ግንኙነት፣ የወሲብ ጓደኛ ሊያስተላልፍብህ/ሽ የሚችለው እንዲሁም ለወሲብ ጓደኛ ልታስተላልፍ/ፊ የምትችለው/የምትችዪውን በሽታ ነው። እነዚህ ጥያቄዎች የግል ምስጢር የሚጠይቁ እንደሆነ እናውቃለን፤ ነገር ግን ስምህ/ስምሽ እዚህ ቅጽ ላይ የትም ቦታ እንደማይኖር አስታውስ/ሽ።"},
    {id: 21, instruction_id: 34, language: "km", text: "សំណួរដូចខាងក្រោម គឺនិយាយអំពីប្រវត្តិ STI ផ្ទាល់ខ្លួនរបស់អ្នក ការប្រើប្រាស់ការទប់ស្កាត់កំណើតរបស់អ្នក និងស្ថានភាពហ៊ីវ និងការធ្វើតេស្តរបស់អ្នក។ តាមរយៈពាក្យ Sexually Transmitted Infections (STI) ខ្ញុំចង់មានន័យថា ជាជម្ងឺឆ្លងដែលដៃគូរបស់អ្នក អាចចំលងទៅ អ្នក ឬអ្នកអាចចំលងទៅដៃគូរបស់អ្នកតាមរយៈការរួមភេទ។ យើងដឹងថា សំណួរទាំងនេះ គឺជាសំណួរផ្ទាល់ខ្លួន ប៉ុន្តែសូមចង ចាំថា ឈ្មោះរបស់អ្នក នឹងមិនឃើញនៅកន្លែងណាមួយនៃ បែបបទនេះឡើយ។"},
    {id: 22, instruction_id: 34, language: "te", text: "క్రింది ప్రశ్నలు మీ వ్యక్తిగత STI చరిత్ర, మీ గర్భనిరోధక వాడకం మరియు మీ HIV స్థితి మరియు పరీక్షించడం గురించి ఉన్నాయి. సంభోగం వ్యాప్తి ఇన్పెక్షన్లు (STI)ద్వారా, అంటే మీ భాగస్వామి లైంగిక సంభోగమ ద్వారా మీకు సంక్రమింపజేసేది లేదా మీరు సంమీ బాగస్వామికి సంక్రమింపజేసేది అని అర్ధము. ఇవి వ్యక్తిగత ప్రశ్నలు అని మాకు తెలుసు,కానీ  ఈ పత్రంపై మీ పేరు ఎక్కడా కనిపించదని గుర్తుంచుకోండి."},
    {id: 23, instruction_id: 41, language: "sw", text: "Sasa tunazo baadhi ya makala kuhusu VIRUSI na UKIMWI ambayo tungependa uyajibu. Kwa kila makala, tafadhali niambie ikiwa Unakana Kabisa, Unakana, Unakubali, au Unakubali Kabisa."},
    {id: 24, instruction_id: 41, language: "am", text: "አሁን ስለ እች.አይ.ቪ እና ኤድስ እንድትመልስ/ሽልን የምንፈልጋቸው አረፍተነገሮች አሉን። ለያንዳንዱ አረፍተነገሮች እባክህ/ሽ በታም እቃወማለሁ፣ እቃወማለሁ፣ እስማማለሁ፣ በጣም እስማማለሁ በማለት ንገረኝ/ንገሪኝ።"},
    {id: 25, instruction_id: 41, language: "km", text: "ឥឡូវនេះ យើងមានអំណះអំណាងមួយចំនួនអំពីហ៊ីវ និង អេដស៏ ដែលយើងចង់ឱ្យអ្នកឆ្លើយ។ សំរាប់អំណះអំ ណាងនីមួយៗ សូមប្រាប់ខ្ញុំថាតើអ្នក មិនយល់ព្រមយ៉ាងខ្លាំង មិនយល់ព្រម យល់ព្រម យល់ព្រមខ្លាំង ។"},
    {id: 26, instruction_id: 41, language: "te", text: "మీరు సమాధానము చెప్పాలని మేము కోరుతున్న, హెచ్ ఐ వి మరియు ఎయిడ్స్ గురించిన ఒక ప్రశ్నల సముదాయము ఇప్పుడు మా వద్ద  ఉంది. ప్రతి వ్యఖ్య కొరకు, మీరు గట్టిగా అ౦గీకరి౦చరో, అ౦గీకరి౦చరో, అ౦గీకరిస్తారో, గట్టిగా అ౦గీకరిస్తారో నాకు దయచేసి చెప్పండి."},
    {id: 27, instruction_id: 42, language: "sw", text: "Sasa tunazo baadhi ya makala kuhusu ngono na mipira ambayo tungependa uyajibu. Kwa kila makala, tafadhali niambie ikiwa Ninakataa kabisa, Sikubaliani nawe, Ninakubaliana nawe, au Ninakubaliana nawe kabisa."},
    {id: 28, instruction_id: 42, language: "am", text: "አሁን ስለ ወሲብና ስለ ኮንዶም እንድትመልስ/ሽልን የምንፈልጋቸው አረፍተነገሮች አሉን። ለያንዳንዱ አረፍተነገሮች እባክህ/ሽ በጣም  እቃወማለሁ፣ እቃወማለሁ፣ እስማማለሁ፣ በጣም እስማማለሁ በማለት ንገረኝ/ንገሪኝ።"},
    {id: 29, instruction_id: 42, language: "km", text: "ឥឡូវនេះ យើងមានអំណះអំណាងមួយចំនួនអំពីសិច និង ស្រោមអនាម័យ ដែលយើងចង់ឱ្យអ្នកឆ្លើយ។ សំរាប់អំណះអំ ណាងនីមួយៗ សូមប្រាប់ខ្ញុំថាតើអ្នក មិនយល់ព្រមយ៉ាងខ្លាំង មិនយល់ព្រម យល់ព្រម យល់ព្រមខ្លាំង ។"},
    {id: 32, instruction_id: 44, language: "am", text: "በሚከተሉት ዓረፍተ ነገር ምን ያህል ትስማማበታለህ?"},
    {id: 33, instruction_id: 44, language: "km", text: "តើអ្នកយល់ព្រម ឬ មិនយល់ព្រមកំរិតណា ជាមួយនិងសេក្តីថ្លែងការខាង ក្រោមនេះ?"},
    {id: 34, instruction_id: 44, language: "te", text: "ఈ క్రి౦ది ప్రతి వాఖ్యముతో మీరు ఎ౦త అ౦గీకరిస్తారు లేదా అ౦గీకరి౦చరు?"},
    {id: 35, instruction_id: 46, language: "sw", text: "Utangulizi. Seti ijayo ya maswali inalenga mambo yanayohusu afya yako kama mwanamke. Tafadhali chukua muda kujibu maswali haya, na jisikie huru kuuliza mhojaji kuhusu maswali usiyoyaelewa."},
    {id: 36, instruction_id: 46, language: "am", text: "መግቢያ፦ የሚከተሉት ጥያቄዎች በሴትነትሽ ስለተመለከቱ የጤና ጉዳዮች የሚያተኩሩ ናቸው። እባክዎ እነዚህን ጥያቄዎች ለመመለስ የሚያስፈልግሽን በቂ ጊዜ ዉሰጂ፤ እንዲሁም ቃለ መጠይቅ የሚያደርግሽን ሰው ማንኛውንም ያልተረዳሽው ነገር ካለ ጠይቂ።"},
    {id: 37, instruction_id: 46, language: "km", text: "ការណែនាំ៖ សំណួរបន្ទាប់ទាំងនេះ ផ្តោតលើបញ្ហាទាំងឡាយ ដែលទាក់ទងនឹង សុខភាពរបស់អ្នកជាស្រ្តី។ សូមចំណាយពេលរបស់អ្នក ឆ្លើយសំណួរទាំងនេះ ហើយសូមសាកសួរអ្នកសម្ភាសន៍ដោយសេរី អំពីសំណួរណាមួយ ដែលអ្នកមិនយល់។"},
    {id: 38, instruction_id: 46, language: "te", text: "పరిచయం. తరువాత ప్రశ్నలు స్త్రీగా మీ ఆరోగ్యంపై దృష్టిసారిస్తాయి. ఈ ప్రశ్నలకు జవాబు ఇచ్చేటప్పుడు మీ సమయం తీసుకోండి, మరియు మీకు అర్ధంకాని ఏవైనా ప్రశ్నల గురించి ఇంటర్వ్యూ చేయువారిని నిస్సందేహంగా అడగండి."},
    {id: 39, instruction_id: 56, language: "sw", text: "Uliza kwa kina ikiwa majibu yote ni hapana: \n\"Hata wakati ulikuwa shuleni?\""},
    {id: 40, instruction_id: 56, language: "km", text: "ចូរសួរសំនួរ ប្រសិនបើរាល់ចំលើយសុទ្ធបដិសេធន៍ៈ\n«មិនប្រើ/មាន ទោះបីជាកាលពីនៅរៀន/នៅសាលា?»"},
    {id: 41, instruction_id: 57, language: "sw", text: "Katika miezi 3 iliyopita, ni mara ngapi umetumia  madawa za kulevya ambazo umetaja?"},
    {id: 42, instruction_id: 57, language: "km", text: "នៅក្នុង ៣ខែមុន តើញឹកញាប់ប៉ុនណាដែលអ្នកបានប្រើសារធាតុទាំងអស់ដែលអ្នកបានលើកឡើង?"},
    {id: 43, instruction_id: 58, language: "sw", text: "Maswali yafuatayo ni kuhusu mambo ambayo unaweza kuwa umefanya kwa miezi 12 iliyopita."},
    {id: 44, instruction_id: 58, language: "am", text: "የሚከተሉት ጥያቄዎች ባለፉት 12 ወራት ምናልባት የሰራሀቸው/ሻቸው ሊሆኑ ይችላሉ።"},
    {id: 45, instruction_id: 58, language: "km", text: "សំនួរបន្ទាប់គឺស្តីអំពីរឿងរ៉ាវដែលអ្នកបានធ្វើនៅក្នុង ១២ខែ កន្លងមកនេះ។"},
    {id: 46, instruction_id: 58, language: "te", text: "ఈ క్రి౦ది ప్రశ్నలు గడిచిన 12 నెలల కాల౦లో మీరు ఒకవేళ చేసి ఉన్న పనుల గురి౦చినవి."},
    {id: 47, instruction_id: 59, language: "sw", text: "Waweza kuwa bila raha unapojibu baadhi ya maswali haya. Tafadhali kumbuka kuwa unaweza kukataa kujibu swali lolote au kuacha kidadisi wakati wowote. Unaweza pia kuruka swali lolote ambalo huna raha kulijibu. Majibu yako ni ya siri na yatatumiwa tu kutusaidia kuelewa jinsi watu wanavyofikiria na kutenda."},
    {id: 48, instruction_id: 59, language: "am", text: "አሁን የምንጠይቅንህ/ሽን አንዳንዶቹን ጥያቄዎች ለመመለስ ምቾት አይሰማህ/ሽ ይሆናል። ማንኛውም ጊዜ ጥያቄ መመለስ አልፈልግም ማለት ወይም ማቆም ትችላለህ/ሽ። ለመመለስ ምቾት የማይሰማህን/ሽን ጥያቄ መዝላል ትችላልህ/ትችያለሽ። መልሶችህ/ሽ ሚስጥር ናቸው፤ እና የምንጠቀምባቸው በእናንተ እድሜ ያሉ ሰዎች እንዴት እንደሚያስቡ እና አኳሀናቸውን ለመረዳት ነው።"},
    {id: 49, instruction_id: 59, language: "km", text: "អ្នកអាចមានអារម្មណ៍មិនស្រួល||ក្នុងការឆ្លើយទៅនឹង||សំណួរទាំងនេះ។ សូមចងចាំថា ជានិច្ចកាលអ្នកអាចបដិសេធ||មិនឆ្លើយសំណួរណាមួយ ឬបញ្ឈប់បញ្ជីសំណួរនេះ||នៅពេលណាក៏បាន។ អ្នកក៏អាចរំលងសំណួរ ណាមួយដែលអ្នកមានអារម្មណ៍||មិនស្រួលក្នុងការឆ្លើយបាន។ ចម្លើយ របស់អ្នក នឹងត្រូវបានគេរក្សាការសម្ងាត់ ហើយគេគ្រាន់តែប្រើប្រាស់ ដើម្បីជួយស្វែងយល់ពីរបៀបដែល មនុស្សស្របាលអ្នក គិត និង||ធ្វើតែប៉ុណ្ណោះ។"},
    {id: 50, instruction_id: 59, language: "te", text: "ఈ ప్రశ్నలు కొన్నింటికి జవాబు చేయడానికి మీకు అసౌకర్యంగా అనిపించవచ్చు. మీరు ఏదైనా జవాబును తిరస్కరించవచ్చు లేదా ప్రశ్నావళిని ఏ సమయంలోనైనా ఆపివేయవచ్చని దయచేసి గుర్తుంచుకోండి. మీకు అసౌకర్యంగా ఉండే ఏదైనా ప్రశ్నను కూడా మీరు వదిలేయవచ్చు. మీ జవాబులు గోప్యంగా ఉంటాయి మరియు మీ వయస్సు వ్యక్తులు ఎలా ఆలోచిస్తారు మరియు స్పందిస్తారో అర్ధం చేసుకోవడానికి సహాయంగా మాత్రమే ఉపయోగిస్తారు"},
    {id: 51, instruction_id: 61, language: "sw", text: "Maswali yafuatayo yanahusu huduma ya jamii wanaofanya kazi kupitia mashirika kama vilabu vya huduma, kanisa, vikundi vya vitndo kwa vijana. Jumlisha tu kazi ya kujitolea ambayo haikulipiwa."},
    {id: 52, instruction_id: 61, language: "am", text: "ቀጥሎ ያሉት ጥያቄዎች በአገልግሎት ክለቦች፣ ቤተ ክርስትያኖች፣ እና የማህበረሰብ እንቅስቃሴ ብድኖች በኩል የሚፈጸሙ የፈቃደኝነት ስራዎች እና የኮሚኒቲ አገልግሎት ስራዎች የሚመለከት ነው። በፈቃደኝነት የተሰራ ክፍያ ያልተገኘበት ስራ ብቻ ያጠቃልሉ።"},
    {id: 66, instruction_id: 70, language: "am", text: "ብዙውን ጊዜ ሰዎች ጓደኝነት፣ እገዛ ወይም ሌላ ዓይነት ድጋፍ በመፈለግ ከሰዎች ጋር ይቀራረባሉ። የሚያስፈልግህ/ሽ ሆኖ ቢገኝ ከዚህ በታች የተጠቀሰውን እያንዳንዱን እገዛ ምን ያህል ማግኘት ትችላለህ/ያለሽ?"},
    {id: 53, instruction_id: 61, language: "km", text: "សំនួរបន្ទាប់ទំាងឡាយនេះគឺស្តីពី||ការងារសេវ៉ាកម្មស្ម័គ្រចិត្ត||និង||សេវ៉ាកម្មសហគមតាម\r\nរយៈអង្គការទំាងឡាយដូចជា||ក្លឹបសេវ៉ាកម្ម ព្រះវិហារ និងក្រុមសកម្មភាពសង្គម។រួមតែការងារស្ម័គ្រចិត្ត||ដែលមិនទទួលកំរៃ។"},
    {id: 54, instruction_id: 61, language: "te", text: "సేవ క్లబ్బులు, చర్చి, మరియు సామాజిక చర్య సమూహాలు, వంటి సంస్థల ద్వారా జరిపే స్వచ్ఛంద మరియు సామాజిక సేవ పనుల గురించి తదుపరి ప్రశ్నలు ఉన్నాయి. డబ్బులు చెల్లించబడని స్వచ్ఛంద పనులను మాత్రమే కలపండి."},
    {id: 55, instruction_id: 62, language: "sw", text: "Orodha zifuatazo ni baadhi ya ugumu au msukosuko wa vitu ambavyo wakati mwingine hufanyika kwa watu. Kwa kila tukio tafadhali onyesha:\na) Ilikufanyikia wewe binafsi\nb) ulishuhudia ikifanyikia mtu mwingine\nc) uliitambua  ikifanyikia  mtu wa familia wa karibu ama rafiki wa karibu;\nd) ulikuwa na ufahamu kuihusu kama sehemu ya kazi yako (kwa mfano, paramedic, polisi, jeshi, ama mhojiwa wa kwanza);\ne) Huna uhakika kama inaingiana; au\nf) Haitumiki kwako.\n\nKuwa na uhakika kuzingatia maisha yako yote (kukua pamoja na kuwa mtu mzima) unapopitia orodha ya matukio."},
    {id: 56, instruction_id: 62, language: "km", text: "ខាងក្រោមនេះគឺជារឿងលំបាក ឬក៏ ស្មុគស្មាញមួយចំនួនដែលជួនកាលកើតឡើងចំពោះមនុស្ស។ ចំពោះព្រឹត្តិការណ៍នីមួយៗសូមចង្អុលបង្ហាញថា:\n\n(a) វាបានកើតឡើងចំពោះអ្នកផ្ទាល់។\n(b) អ្នកបានឃើញវាកើតឡើងចំពោះនរណាម្នាក់ផ្សេងទៀត។\n(c) អ្នកបានដឹងអំពីបញ្ហានេះកើតឡើងចំពោះសមាជិកគ្រួសារជិតស្និទ្ធឬមិត្តជិតស្និទ្ធ។\n(d) អ្នកត្រូវបានបង្ហាញវាជាផ្នែកនៃការងាររបស់អ្នក (ឧទាហរណ៍ ពេទ្យយោធា ប៉ូលីស យោធា ឬ អ្នកឆ្លើយដំបូងគេផ្សេងទៀត) ។\n(e) អ្នកមិនប្រាកដថាប្រសិនបើវាសមឬក៏អត់; ឬ \n(f) វាមិនត្រូវចំពោះអ្នកទេ។ \n\nត្រូវប្រាកដថាការគិតអំពីជីវិតទាំងមូលរបស់អ្នក (តាំងពីកំពុងលូតលាស់ក៏ដូចជាភាពពេញវ័យ) នៅពេលដែលអ្នកឆ្លងកាត់បញ្ជីព្រឹត្តិការណ៍។"},
    {id: 57, instruction_id: 67, language: "sw", text: "Kwa kila moja ya usemi ufuatao, tafadhali niambie kama Sio Kweli, Ni Kweli Kiasi, au Ni Kweli Kabisa kukuhusu.  Ingetusaidia kama ungejibu kila kitu vizuri hata kama huna uhakika. Tafadhali toa jibu lako kwa msingi ya vile mambo yamekuwa kwako kwa miezi sita iliyopita. Kumbuka, majibu yako yote ni ya siri."},
    {id: 58, instruction_id: 67, language: "am", text: "ለሚከተሉት አረፍተ ነገሮች፣ እባክህ/ሽ ስላንተ/ስላንቺ- እውነት እንዳልሆነ፣ በተወሰነ መጠን እውነት እንደሆነ፣ ወይም በርግጥ እውነት እንደሆነ ንገረኝ/ንገሪኝ። በጣም እርግጠኛ ባትሆንም/ባትሆኚም እንኳን፣ ለሁሉም በተቻለ መጠን መልስ ብትሰጠን/ብትሰጪኝ በጣም ይረዳናል። ነገሮች ባለፉት 6 ወራት እንዴት እንደነበሩ በመመርኮዝ መልስ ስጥ/ስጪ። መልሶቹ በሙሉ በጥብቅ ሚስጥርነት እንደሚጠበቁ አትዘንጋ/ጊ።"},
    {id: 59, instruction_id: 67, language: "km", text: "សម្រាប់អំណះអំណាងនីមួយៗដូចខាងក្រោម សូមប្រាប់ខ្ញុំថាតើវា មិនពិត ពិតតិចតួច ឬប្រាកដជាពិត សម្រាប់អ្នក។ ចម្លើយរបស់អ្នក នឹងជួយយើងច្រើន បើសិនជាអ្នកឆ្លើយបានគ្រប់ចំណុចទាំងអស់ បើទោះជាអ្នកមិនប្រាកដក៏ដោយ។ សូមផ្តល់ចម្លើយរបស់អ្នកទៅតាម រឿងរ៉ាវដែលបានកើតឡើងចំពោះអ្នកក្នុងរយៈពេលប្រាំមួយខែ ចុងក្រោយ។ សូមចងចាំថា ចម្លើយរបស់អ្នកទាំងអស់ នឹងត្រូវ បានគេរក្សាការសម្ងាត់។"},
    {id: 60, instruction_id: 67, language: "te", text: "క్రింద తెలిపిన ప్రతి వాక్యానికి, ఇది మీకునిజం కాదు, కొంత నిజం, లేదా ఖచ్చితంగా నిజం కాదేమో దయచేసి నాకు చెప్పండి. ఇది మీకు ఖచ్చితంగా తెలియకపోతే మీకు ఉత్తమంగా తెలిసిన వాటిని మీరు జవాబుచేస్తే మాకు సహాయపడుతుంది. గత ఆరు నెలల నుండి మీకు విషయాలు ఎలా ఉన్నాయో ఆధారంగా దయచేసి మీ జవాబులు ఇవ్వండి. మీ జవాబులు గోప్యంగా ఉంటాయని, గుర్తుంచుకోండి."},
    {id: 61, instruction_id: 68, language: "sw", text: "Tafadhali tuambie ni mara ngapi matamko yafuatayo ni kweli. Ni kweli \"Hapana\", \"Wakati mwingine,\" au \"Kila wakati\""},
    {id: 62, instruction_id: 68, language: "am", text: "ከዚህ ቀጥሎ የተጠቀሱት ሐሳቦች እያንዳንዳቸው ያህል እውነት እንደሆኑ ይንገሩን። “ጨርሶ እውነት አይደለም”፣ “አንዳንድ ጊዜ እውነት ነው” ወይስ “ሁልጊዜ እውነት ነው”?"},
    {id: 63, instruction_id: 68, language: "km", text: "សូមប្រាប់យើងថា តើសេចក្តីថ្លែងនិមួយៗតទៅនេះ វាពិតញឹកញាប់យ៉ាងណា។ តើវាពិត​\"គ្មានទាល់តែសោះ\"​\"ពេលខ្លះ\"​\"គ្រប់ពេលទំាងអស់\"?"},
    {id: 64, instruction_id: 68, language: "te", text: "కింద ఇచ్చిన వ్యాఖ్యలు ఎంత తరచుగా నిజమో దయచేసి చెప్పండి.\r\nఇది నిజమా, \"ఏ సమయములోనూ కాదు\", \"కొన్ని సమయాలు\",లేదా \"అన్ని సమయాలు\"?"},
    {id: 65, instruction_id: 70, language: "sw", text: "Wakati mwengine watu hutazamia wenzao ili wapate ushirika, msaada, au aina nyengine za usaidizi. Ni mara ngapi wewe huwa wapata kila aina ya usaidizi ufwatao kila mara unapohitaji?"},
    {id: 67, instruction_id: 70, language: "km", text: "មនុស្សយើងជួនកាលមើលទៅអ្នកដទៃទៀតដើម្បីរកដៃគូ​ ជំនួយ ឬជំនួយ ប្រភេទដទៃទៀត។ តើញឹកញាប់យ៉ាងណាដែលជំនួយប្រភេទនិមួយៗ តទៅនេះមានសំរាប់អ្នកបើអ្នកត្រូវការវា?"},
    {id: 68, instruction_id: 70, language: "te", text: "వ్యక్తులు కొన్ని సమయాలలో ఇతరుల సాహచర్యము,సహాయము, లేదా వేరే విధమైన మద్దతు కోసం చూస్తారు. మీకు అవసరమైనప్పుడు,ఎంత తరచుగా మీకు కింద ఇచ్చినటువంటి మద్దతు దొరికింది?"},
    {id: 69, instruction_id: 72, language: "sw", text: "Katika maisha yako ya kila siku ni mara ngapi vitu vifwatavyo vimekufanyikia?"},
    {id: 70, instruction_id: 72, language: "km", text: "នៅក្នុងជីវិត មួយថ្ងៃ ទៅ មួយថ្ងៃរបស់អ្នក តើញឹកញាប់ប៉ុនណាដែលរឿងរ៉ាវណាមួយដូចខាងក្រោមនេះបានកើតឡើងចំពោះអ្នក?"},
    {id: 71, instruction_id: 76, language: "sw", text: "Maswali 2 yafuatayo yanauliza kuhusu hisia zako."},
    {id: 72, instruction_id: 76, language: "am", text: "የሚቀጥሉት 2 ጥያቄዎች ስለአንተ/አንቺ ስለተሰማህ/ሽ ስሜቶች ይጠይቃሉ።"},
    {id: 73, instruction_id: 76, language: "km", text: "សំណួរ ២ បន្ទាប់នេះ សួរអំពីអារម្មណ៍របស់អ្នក។"},
    {id: 74, instruction_id: 76, language: "te", text: "తరువాత 2 ప్రశ్నలు మీ అనుభూతుల గురించి అడుగుతాయి."},
    {id: 75, instruction_id: 77, language: "sw", text: "IMPORTANT:\r\n\r\nIf the child answers “yes” to either of the two questions above, he/she should be referred to support services and monitored closely after the interview is over. Follow your site’s protocol for dealing with situations where the child is upset or reports feeling suicidal."},
    {id: 76, instruction_id: 90, language: "sw", text: "Fikiria kwamba hii ngazi inawakilisha jinsi jamii imeundwa. Hapo juu ya ngazi ni watu ambao wanajiweza - wana pesa nyingi, kiwango cha juu masomo, na kazi ambazo zinaleta heshima kuu. Hapo chini ni watu ambao hawajiwezi kabisa - wana pesa kidogo,masomo kidogo au hawana masomo, hawana kazi au kazi ambazo hakuna mtu anazitaka au kuziheshimu."},
    {id: 77, instruction_id: 90, language: "am", text: "ይህ መሰላል የማህበረሰቡን የህይወት ደረጃ የሚያሳይ ምስል ነው፡፡ በመሰላሉ ጫፍ ላይ ያሉ ሰዎች በጣም የተሻሉ  ናቸው፡፡ በጣም ብዙ ገንዘብ ፣ ከፍተኛ የትምህርት ደረጃ ፣ እና ከፍተኛ ክብርን የሚያመጡ ስራ ያላቸው ሲሆን ከታች ያሉት በጣም የከፋ የህይወት ደረጃ ላይ ያሉ አነስተኛውን ገንዘብ ያላቸው ፣ ትንሽ\nወይም ምንም ትምህርት ፣ ሥራ የሌላቸው ወይም ሰዎች የማይመርጡትን ወይም ማያከብሩትን ስራ ሚሰሩ ናቸው፡፡"},
    {id: 78, instruction_id: 90, language: "km", text: "ស្រមៃថាកាំជណ្ដើរនេះ តំណាងឲ្យពីការកំណត់របស់សង្គម។ កាំលើបំផុតនៃជណ្ដើរគឺជាមនុស្សល្អផ្ដាច់គេ។ ពួកគេមានលុយច្រើនជាងគេ រៀនសាលាល្អជាងគេ ហើយធ្វើការងារដែលទទួលបានការគោរពខ្ពស់។ កាំនៅខាងក្រោម គឺជាមនុស្សដែល មានលុយតិចជាងគេ រៀនបានតិចឬមិនបានរៀន គ្មានការងារឬ ការងារគ្មានអ្នកណាចង់ធ្វើឬគោរព។"}
  ])
